(713, 9, '1129000100', 0, 1, NULL, '', 'Nordik Колонна 2900', 'Nordik Колонна 2900', 'Пьедестал из штампованного алюминия, окрашенного порошковой краской, для раковин 2560, 2600 и 2700. <br /><br />Пьедестал из штампованного алюминия, окраска порошковой краской. Пьедестал регулируется по высоте, что позволяет устанавливать его после установки раковины.</p><p><strong>Монтаж<br /></strong>Пьедестал крепится к входящим в комплект настенным кронштейнам. В комплект поставки входят инструкция по установке и установочные винты.');
