(714, 9, '1129200100', 0, 1, NULL, '', 'Nordik Колонна 2920', 'Nordik Колонна 2920', 'Полупьедестал Nordic 2920 керамический. Для раковин 2560, 2600 и 2700 с сифоном в полу.</p><p><strong>Монтаж<br /></strong>Высота установки раковины должна соответствовать высоте пьедестала. Пьедестал установлен правильно только в том случае, если раковина опирается на него. Пьедестал открыт сзади для размещения сточной трубы, проходящей вдоль стены. Расстояние между тыльной стороной пьедестала и стеной невозможно указать точно из-за влияния некоторых факторов, например погрешностей установки, наклона стен и, в некоторых случаях, свойств керамики. Ориентировочное расстояние 10-12&nbsp;см.'),
(715, 9, '1129300100', 0, 1, NULL, '', 'Nordik Полуколонна 2930', 'Nordik Полуколонна 2930', 'Полупьедестал Nordic 2920 керамический. Предназначен для раковин 2560, 2600 и 2700 с сифоном в стене. <br /><br /><br />Nordic 2930 <br /><br />Упаковка, вес <br />Вес в упаковке 7 кг. <br /><br />Комплектация <br />Внимание! Этот полупьедестал нельзя устанавливать на раковины с ручным душем. <br /><br /><br />Полупьедестал 2930 Nordic фаянсовый, для раковин 2560, 2600 и 2700 L и R <br /><br />Установка <br />Полупьедестал крепится к стене болтами. В комплект поставки входят инструкция по установке и крепеж.'),
(716, 9, '1125006101', 0, 0, NULL, '', 'Nordik Умывальник 2500', 'Nordik Умывальник 2500', 'Раковина 2500 Nordic с переливной системой, для крепления на болтах или кронштейнах, белая.<br /><br />Серия, выделяющаяся качеством и функциональным дизайном. Эта серия продолжает предыдущую основную серию, получившую широкое признание, - серию Nordic. Помимо функциональности, при разработке новой серии выдвигалось основное требование: подчеркнуть в дизайне уникальные свойства керамических санитарно-технических изделий. В различных моделях раковин ясно виден сделанный в дизайне акцент на материале и качестве. Высококачественные полки для косметических средств с защитой от брызг по заднему краю и канавкой для стока воды. Форма раковины способствует экономии воды. Большинство раковин предназначено для установки на болтах или кронштейнах. Таким образом обеспечивается разумное разнообразие без повышения цены. Вся серия Nordic изготавливается только из белой керамики.'),
(717, 9, '1125606101', 0, 1, NULL, '', 'Nordik Умывальник 2560', 'Nordik Умывальник 2560', 'Раковина Nordic 2560 (560x415), белая, для крепления на болтах или кронштейнах. Устанавливается при ремонте и реконструкции. <br /><br />Предназначена для установки на кронштейны, оставшиеся после раковины аналогичного размера. В раковине 2560 предусмотрен увеличенный допуск на расстояние между кронштейнами.</p><p>&nbsp;</p><p>Серия, выделяющаяся качеством и функциональным дизайном. Эта серия продолжает предыдущую основную серию, получившую широкое признание, - серию Nordic. Помимо функциональности, при разработке новой серии выдвигалось основное требование: подчеркнуть в дизайне уникальные свойства керамических санитарно-технических изделий. В различных моделях раковин ясно виден сделанный в дизайне акцент на материале и качестве. Высококачественные полки для косметических средств с защитой от брызг по заднему краю и канавкой для стока воды. Форма раковины способствует экономии воды. Большинство раковин предназначено для установки на болтах или кронштейнах. Таким образом обеспечивается разумное разнообразие без повышения цены. Вся серия Nordic изготавливается только из белой керамики.'),
(718, 9, '1126006101', 0, 1, NULL, '', 'Nordik Умывальник 2600', 'Nordik Умывальник 2600', 'Раковина Nordic 2600, белая, для крепления на болтах или кронштейнах</p><p>Без смесителя, без отв. для дозатора мыла, ручного душа</p><p>Серия, выделяющаяся качеством и функциональным дизайном. Эта серия продолжает предыдущую основную серию, получившую широкое признание, - серию Nordic. Помимо функциональности, при разработке новой серии выдвигалось основное требование: подчеркнуть в дизайне уникальные свойства керамических санитарно-технических изделий. В различных моделях раковин ясно виден сделанный в дизайне акцент на материале и качестве. Высококачественные полки для косметических средств с защитой от брызг по заднему краю и канавкой для стока воды. Форма раковины способствует экономии воды. Большинство раковин предназначено для установки на болтах или кронштейнах. Таким образом обеспечивается разумное разнообразие без повышения цены. Вся серия Nordic изготавливается только из белой керамики.'),
