(770, 9, 'sku_11932365775', 0, 0, NULL, '', 'Полуколонна  Jika FESTA', 'Полуколонна  Jika FESTA', 'Полупьедестал для раковин с крепежом</p>  <p>Мягкие, закругленные формы Jika FESTA, которые сочетаются как с романтическим и элегантным дизайном современных интерьеров &ndash; характерная черта серии Феста. Комплексное предложение санитарной керамики, включая подвесное исполнение, предоставляет возможность комбинировать с различными вариантами ванной мебели Festa.'),
