(816, 9, 'sku_119979583676', 0, 1, NULL, '', 'Умывальник AVOCADO COMFORT P', 'Умывальник AVOCADO COMFORT P', '<a onclick="if (window.oWin) oWin(this.href,350,262,''AVOCADO COMFORT'',''закрыть окно''); return false;" href="http://www.ravak.ua/img/pu/um_avocado_comfort.jpg"></a>      Умывальник AVOCADO Comfort прекрасно сочетается с ванной AVOCADO. Он предназначен для применения в маленьких ванных комнатах, оснащенных этой ванной.<br /><br /> Форма умывальника позволяет разместить его над узкой стороной ванны, где занимает минимум пространства ванной комнаты. По сравнению с умывальником Avocado он имеет полку по-больше, что более комфортно.</p><p><a href="javascript:self.close()" class="window"></a>'),
