(939, 9, 'XJ6L1100000', 0, 0, NULL, '', 'Умывальник Praktik S L', 'Умывальник Praktik S L', '&nbsp;</p><table cellspacing="3" border="0" style="width: 100%;"><tbody><tr valign="center"><td><div align="center"><a onclick="if \n\n\n(window.oWin) oWin(this.href,400,306,''Praktik S'',''закрыть окно'',''''); \n\n\nreturn false;" href="http://www.ravak.ua/img/pu/um_praktik_s.jpg"></a><br /> 			</div></td> <td><div align="justify"><strong>Praktik S</strong><br /> 			Именно этот умывальник доказательство того, что слово практик в  названии не появилось случайно. Умывальник достаточно большой, с полками  с обеих сторон.<br /> 			<br /> 			Первая плоскость (синяя, мокрая) расположена ниже, ограничена по  всему периметру и имеет наклон к месту для мытья. Служит полкой для  вещей, с которых стекает вода, например для мыла, зубной щетки и т.п.Эту  плоскость можно мыть, не боясь, что вода попадет за пределы периметра  плоскости.<br /> 			<br /> 			Вторая плоскость (красная, сухая) расположена выше и служит,  наоборот, полкой для вещей, с которых вода не стекает и поэтому нет  смысла держать их в мокром месте. Этот подход оценит Ваш фен,  электрическая бритва и другие.</div></td></tr></tbody></table><p><a href="javascript:self.close()" class="window"></a>'),
