(942, 9, 'XJ5P1100000', 0, 1, NULL, '', 'Умывальник Praktik U правый', 'Умывальник Praktik U правый', '<strong>Praktik U</strong><br /> 			Именно этот умывальник доказательство того, что слово практик в  названии не появилось случайно. Умывальник достаточно большой, с полкой. 			<br /> 			<br /> 			Форма умывальника Praktik U&nbsp;повторяет форму ванны Praktik и дополняет  ее.</p><p><a class="window" href="javascript:self.close()"></a>'),
(943, 9, 'XJ7L1100000', 0, 1, NULL, '', 'Умывальник Praktik W левый', 'Умывальник Praktik W левый', '<strong>Praktik W</strong><br /> 			Следующее доказательство практичности этих умывальников. Попробуйте  подумать, сколько места в ванной комнате Ваша стиральная машина занимает  &quot;зря&quot;. Если умывальник разместить над стиральную машину, вместо  потерянного пространства получим большую площадь, которая не находится в  контакте со стиральной машиной. Никакие вибрации при стирке не  передаются на плоскость умывальника.</p><div align="center"></div> <p><br /> <a class="window" href="javascript:self.close()"></a></p><!--dolni-->  <p>'),
