(972, 9, 'XJ8L1100000', 0, 1, NULL, '', 'Умывальник Rosa Comfort левый', 'Умывальник Rosa Comfort левый', 'Форма умывальника ROSA COMFORT идеально сочетается с формами ванны ROSA.  Он предназначен, прежде всего, для применения в ванных комнатах малых  размеров, оснащенных этой ванной и шторкой для ванны.<br /> 			<br /> 			<br /> 			Внешнее оформление умывальника подчеркивает держатель полотенца,  который расположен на нижней сороне умывальника.<br /> 			<br /> 			<br /> 			Ровные грани умывальника позволяют расположить его рядом со шторкой  для ванны или в любой угол ванной комнаты.</p><p><a href="javascript:self.close()" class="window"></a>'),
