(996, 9, 'XJ3P1100000', 0, 1, NULL, '', 'Умывальник Uniti 900 правый', 'Умывальник Uniti 900 правый', '<table cellspacing="3" border="0" style="width: 100%;"><tbody><tr valign="center"><td><div align="center"><a onclick="if \n(window.oWin) oWin(this.href,300,122,''Unity 900 L'',''закрыть окно'',''''); \nreturn false;" href="http://www.ravak.ua/img/pu/um_unity_l.jpg"></a></div></td> <td><div align="justify">Умывальник Unity по форме напоминает ванну MAGNOLIA, но его можно  использовать в качестве аксессуара и для других ванн.</div></td> </tr> </tbody> </table> <br /> <table cellspacing="3" border="0" style="width: 100%;"> <tbody> <tr valign="center"> <td><div align="justify">Большие полки, которые предлагает умывальник Unity, очень удобны, но  благодаря небольшой толщине умывальника можно использовать и  пространство под умывальником.</div></td> <td><div align="center"><a onclick="if \n(window.oWin) oWin(this.href,300,122,''Unity 900 P'',''закрыть окно'',''''); \nreturn false;" href="http://www.ravak.ua/img/pu/um_unity_p.jpg"></a></div></td> </tr> </tbody> </table> <br />   <table cellspacing="3" border="0" style="width: 100%;"><tbody><tr valign="center"> <td><div align="center"><a onclick="if \n(window.oWin) oWin(this.href,400,131,''Unity 1200'',''закрыть окно'',''''); \nreturn false;" href="http://www.ravak.ua/img/pu/um_unity_s.jpg"></a></div></td> <td><div align="justify">Ровные грани умывальника позволяют расположить его в любом месте  ванной комнаты.<br /> 			Умывальник Unity выпускается в правом, левом и центровом вариантах.</div></td> </tr> <tr valign="center"> <td colspan="2"><div align="justify"><br /> 			Умывальник Unity можно встраивать в ванную мебель или устанавливать  на стену с помощью держателей, которые не входят в состав изделия.  ДЕРЖАТЕЛИ НАДО ЗАКАЗЫВАТЬ САМОСТОЯТЕЛЬНО!</div></td></tr></tbody></table></p><p><br /> 			Держатель Unity</p><p><a href="javascript:self.close()" class="window"></a>'),
