(1018, 10, '458.161.21.1', 0, 0, NULL, '', 'Geberit Комплект инсталляция для унитаза  Duofix 458.161.21.1 4 в 1', 'Geberit Комплект инсталляция для унитаза  Duofix 458.161.21.1 4 в 1', '<span class="manufacture_text"><p>- в набор входит полный комплект для инсталяции подвесного унитаза:</p> <ul><li>инсталляция с бачком;</li><li>крепления для инсталляции;</li><li>кнопка смыва под инсталляцию;</li><li>звукоизоляционная прокладка для инсталляции.</li></ul><p></p><p><span class="manufacture_text">- крепления 111.839.00.1;</span></p><p><span class="manufacture_text"></span></p><p><span class="manufacture_text">- звукоизоляционной прокладки 56.050.00.1;</span></p><p><span class="manufacture_text"></span></p><p><span class="manufacture_text">- клавиши &quot;Delta 21&quot;,&nbsp; хром глянцевый 115.125.21.1;</span></p><p><span class="manufacture_text"></span></p><p><span class="manufacture_text"><p>Смывные клавиши новой серии Delta изумляют своим стильным дизайном. Уменьшенные по сравнению с предыдущим поколением размеры смывных клавиш полностью соответствуют новейшим тенденциям и обеспечивают абсолютною гармонию клавиш с дизайном ванных комнат.</p> <p>- размеры 112 х 50 см;</p> <p>- фронтальное управление;</p> <p>- подвод воды по центру сзади или сверху;</p> <p>- двойной смыв 6/9 л;</p> <p>- регулируемый объем смыва;</p> <p>- бачок скрытого монтажа для установки и ремонта без применения инструментов;</p> <p>- не требующее применения инструментов звукопоглощающее крепление для фанового отвода, регулируется по глубине в 8 положениях, диапазон регулировки - 45 мм;</p> <p>- самостопорящиеся оцинкованные опоры в пол с метками для выравнивания элемента без применения инструментов;</p> <p>- бачок скрытого монтажа в противоконденсатной оболочке;</p> <p>- самонесущая конструкция;</p> <p>- защитный слой цвета &quot;Geberit синий&quot; нанесен порошковым напылением;</p> <p>- поворотная опорная площадка.</p> <p><span>Технические данные:<br /> </span></p> <ul><li>Заводская установка объема смыва 6 / 3 л</li><li>Диапазон малого смыва 3 - 4 л</li><li>Диапазон большого смыва 6 / 7,5 л</li><li>Смыв/стоп 6 / 7,5 л</li></ul> <p><span> Применение:<br /> </span></p> <ul><li>Для установки перед капитальной стеной или пустотелой перегородкой</li><li>Для скрытой установки в гипсокартонной перегородке или на капитальной стене с облицовкой панелями (гипсовыми или деревянными)</li><li>Для установки в пристенке в высоту помещения или в разделительной перегородке</li><li>Для крепежа в пол (0 - 20 см)</li><li>Для унитазов с межосевым расстоянием под крепежные шпильки 18 см или 23 см</li><li>Для скрытой установки на капитальной стене</li></ul> <p>Объем поставки:</p> <ul><li>Подключение к системе водоснабжения R 1/2 со встроенным угловым запорным вентилем и ручным маховичком.</li><li>Колено смыва.</li><li>Защитная заглушка.</li><li>Коробка монтажная для окна обслуживания.</li><li>крепление.</li><li>клавиша.</li><li>прокладка для звукоизоляции.</li></ul><p></p><p></p></span></p></span>'),
(1019, 10, '111.240.00.1', 0, 0, NULL, '', 'Geberit Система Инсталляции для унитаза со встроенным бачком; низкая; Duofi', 'Geberit Система Инсталляции для унитаза со встроенным бачком; низкая; Duofi', 'Geberit Duofix UP200 монтажная рама (инсталляция) для подвесного унитаза 111.240.00.1 высота 82см. <br />Для скрытой установки в гипсокартонной перегородке или на капитальной стене. <br />Для унитазов с межосевым расстоянием 18см или 23см. <br />самонесущая стальная рама с порошковым напылением для облицовки гипсоволоконной плитой монтаж перед стеной / стенной перегородкой <br />для монтажа требуется: <br /><br /><br />крепежные уголки (111.815.) <br /><br />для монтажа в углу (111.835.) <br /><br />смывная кнопка Kappa 20 / Kappa 50 <br />2 механические системы смыва: 2 объема смыва, старт/стоп регулировка объема смыва 6/9 л <br />500х820 мм <br />подключение воды по центру сзади / сверху <br />изоляция от конденсационной влаги <br />Комплектация: <br /><br />2 болта-держателя для унитаза М12, расстояние между болтами 180/230 мм <br /><br />вентиль угловой 1/2&quot; для подключения воды <br /><br />гарнитур впускной, гарнитур смывной <br /><br />полная предварительная заводская сборка <br /><br />диаметр смывной дуги 90 мм <br /><br />адаптер 90/110 мм <br />Гарантия 10 лет'),
