(1091, 10, 'A101', 0, 1, NULL, '', 'Скрытая система инсталляции 1200*150*520', 'Скрытая система инсталляции 1200*150*520', '<a href="javascript:self.close()" class="window"></a></p><p>Строителна височина 1 176 mm. Ъгълов клапан &ndash; изпробваният ъгълов  клапан Schell осигурява със своята мощна месингова конструкция и  качество на използваните уплътняващи материали дълготрайн отлично  функциониране.</p><p><br /> <a onclick="if \n(window.oWin) oWin(this.href,800,618,'''',''закрыть окно'',''''); return \nfalse;" href="http://www.alcaplast.cz/img/_/p01/01e_big.jpg"></a></p><div class="clear"><!-- --></div>  <p>&nbsp;</p><p>Двуактивно пускане на вода с хигиенична резерва</p> 		<ul><li>Пестеливо (малко пускане) &ndash; 3 л напр. при малка нужда.</li><li>Икономично (голямо пускане) &ndash; 6 л напр. при голяна нужда.</li><li>Хигиенично &ndash; след използване на голямото пускане, в резервоара  остава 3 л вода, които веднага са на разположение за допълнително  пускане на вода или измиване на чинията  (напр. при използване на четка  за WC чиния). Пуска се с натискане и придържане на произволен бутон.</li></ul> 		<p><br /> <a onclick="if \n(window.oWin) oWin(this.href,800,536,'''',''закрыть окно'',''''); return \nfalse;" href="http://www.alcaplast.cz/img/_/p01/01d_big.jpg"></a>'),
