(1264, 11, 'C321000000', 0, 0, NULL, '', 'Ванна Safe L165-88', 'Ванна Safe L165-88', '<strong></strong></p><p><strong><table cellspacing="0" cellpadding="3" border="0"><tbody><tr valign="middle"><td width="205"><div align="center"><br /><br /></div></td><td><div align="justify"><strong>Safe, ванна для Вашей безопасности.</strong></div><div align="justify"><br />Пониженный передний бордюр и достаточное пространство для сидения на ванне позволяет безопасный вход и выход&nbsp;из ванны.&nbsp;</div><div align="justify"><br />Внутреннее пространство ванны разделено на две части - возвышенную часть для удобного подъема и мытья и более глубокую часть</div><div align="justify">для безопасного и экономного принятия ванны.&nbsp;Ванну можно дополнить практичной ручкой для безопасного движения внутри ванны.</div></td></tr></tbody></table><br /></strong>'),
