(1580, 13, '896GKU10Y15', 0, 0, NULL, '', 'Гидромассажный бокс WhiteWater L Orange', 'Гидромассажный бокс WhiteWater L Orange', 'Конструкция решена полностью новым способом. Элементы конструкции (алюминиевые стойки) находятся внутри душевого уголка. Внешняя оболочка душевого уголка создана только из прозрачного стекла. (Ателье Design a Storz)<br /><br />Петли дверей созданы так, чтобы соответствовали этому весьма оригинальному решению конструкции. (Ателье Design a Storz)'),
(1581, 13, '886GKU10Y15', 0, 0, NULL, '', 'Гидромассажный бокс WhiteWater OVO-POronge', 'Гидромассажный бокс WhiteWater OVO-POronge', 'Превосходному изделия соответствуют и использованные элементы управления. Конструкция душевого уголка состоит из трех алюминиевых стоек с поверхностной обработкой сатин.<br />\n<br />\nПотолочная головка душа- суперплоская тарелка толщиной 20 мм. Это уже не лейка для огорода!<br />\n(Ателье Design a Storz)<br />\n<br />\nСуперплоская конструкция головки препятствует застою воды в пространстве над микрофорсунками. После выключения воды мгновенно и полностью прекращает из головки душа капать вода.<br />\n(Конструкторское бюро RAVAK)<br />\n<br />\nНа эргонометрическом сидении из прозрачного пластика Вы по настоящему отдохнете. <br />\n(Ателье Design a Storz)<br />\n<br />\nПоддон - литой из высокопрочного материала. Из того же материала произведена и декоративная крышка.</p>\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </p>\n<p>'),
(1582, 13, 'SKU-3263', 0, 0, NULL, '', 'Гидромассажный бокс WhiteWater Steam Clear L', 'Гидромассажный бокс WhiteWater Steam Clear L', 'Конструкция решена полностью новым способом. Элементы конструкции (алюминиевые стойки) находятся внутри душевого уголка. Внешняя оболочка душевого уголка создана только из прозрачного стекла. (Ателье Design a Storz)<br /><br />Петли дверей созданы так, чтобы соответствовали этому весьма оригинальному решению конструкции. (Ателье Design a Storz)</p><p>это душевой уголок Whitewater оснащенный двумя точечными светильниками, парогенератором, управляемым электроникой и паронепроницаемой крышей из прозрачного пластика.'),
(1583, 13, '48750-33-909', 0, 1, NULL, '', 'Душевая кабина IDO Showerama 9-5 90х90', 'Душевая кабина IDO Showerama 9-5 90х90', '<a href="http://www.elitteplo.kiev.ua/santehnika-dushevye-kabiny-c-54_115.html" title="душевые кабины"></a></p><p>Душевая кабина <strong>IDO Showerama 9-5 90х90</strong> &ndash; это идеальное решение из Финляндии.  Простые незамысловатые формы <strong>IDO Showerama 9-5 90х90</strong> в сочетании с безупречным качеством и надежностью создают совершенную душевую кабину, которая прослужит Вам долгий срок и доставит массу удовольствия в эксплуатации. Душевые кабины <strong>IDO Showerama 9-5 90х90</strong> многофункциональны и существуют они в разных профилях, с разным типом стекол, поэтому Вы можете выбрать любой вариант, который лучше подходит для вашей ванной комнаты. <br /><br />Душкабина <strong>IDO Showerama 9-5</strong> имеет размер 90х90 см, ее высота сотавляет 207 см. В комплекте с душевой кабиной идут три встроенные полки, верхний душ и ручная душевая лейка с большим количеством функций. Также в комплект включен термостатический смеситель.'),
