(1586, 14, '940A0102ZG', 0, 0, NULL, '', 'APSS-100 (Grape) Душевая жесткая стенка', 'APSS-100 (Grape) Душевая жесткая стенка', 'Объединяя душевые двери и неподвижную стенку APSS можно получить большое количество душевых уголков различной формы и размеров.Неподвижные душевые стенки можно комбинировать с большинством изделий серии Supernova II,что существенно увеличивает количество возможных вариантов.'),
(1587, 14, 'SKU-3149', 0, 0, NULL, '', 'APSS-75 (Grape) Душевая жесткая стенка', 'APSS-75 (Grape) Душевая жесткая стенка', 'Объединяя душевые двери и неподвижную стенку APSS можно получить большое количество душевых уголков различной формы и размеров.Неподвижные душевые стенки можно комбинировать с большинством изделий серии Supernova II,что существенно увеличивает количество возможных вариантов.'),
(1588, 14, 'SKU-3159', 0, 0, NULL, '', 'APSS-90 (Grape) Душевая жесткая стенка', 'APSS-90 (Grape) Душевая жесткая стенка', 'Объединяя душевые двери и неподвижную стенку APSS можно получить большое количество душевых уголков различной формы и размеров.Неподвижные душевые стенки можно комбинировать с большинством изделий серии Supernova II,что существенно увеличивает количество возможных вариантов.'),
(1589, 14, 'SKU-3160', 0, 0, NULL, '', 'APSS-90 (Pearl) Душевая жесткая стенка', 'APSS-90 (Pearl) Душевая жесткая стенка', 'Объединяя душевые двери и неподвижную стенку APSS можно получить большое количество душевых уголков различной формы и размеров.Неподвижные душевые стенки можно комбинировать с большинством изделий серии Supernova II,что существенно увеличивает количество возможных вариантов.'),
(1590, 14, '95010102ZG', 0, 1, NULL, '', 'APSV-70 (Grape) Жесткая стенка для ванны', 'APSV-70 (Grape) Жесткая стенка для ванны', 'Неподвижные стенки для ванной можно комбинировать с большинством изделий серии Supernova II,что существенно увеличивает количество возможных вариантов.К примеру,комбинация AVDP3+APSV позволяет создать в вашей ванной душевой уголок с максимально возможной герметичностью.'),
(1591, 14, 'SKU-3169', 0, 1, NULL, '', 'APSV-75 (Grape) Жесткая стенка для ванны', 'APSV-75 (Grape) Жесткая стенка для ванны', ''),
(1592, 14, '9503010241', 0, 1, NULL, '', 'APSV-75 (Rain) Жесткая стенка для ванны', 'APSV-75 (Rain) Жесткая стенка для ванны', '&nbsp;Если необходимо создать над ванной душевой уголок с максимально возможной герметичностью, то тогда лучше всего воспользоваться комбинацией AVDP3 + APSV.<br /><br />&nbsp; Примером решения совершенно герметичного душевого пространства над ванной, установленной в нише, является использование душевых дверей типа AVDP3.</p><p>Rain</p><p>&nbsp;'),
(1593, 14, '00VA0102ZG', 0, 1, NULL, '', 'ASDP3-100 (Grape) Душевая дверь', 'ASDP3-100 (Grape) Душевая дверь', ''),
(1594, 14, '00VA0102Z1', 0, 0, NULL, '', 'ASDP3-100 (Transp) Душевая дверь', 'ASDP3-100 (Transp) Душевая дверь', ''),
(1595, 14, '00V40102ZG', 0, 1, NULL, '', 'ASDP3-80 (Grape) Душевая дверь', 'ASDP3-80 (Grape) Душевая дверь', 'Душевые двери используются ,в первую очередь,в тех случаях,когда необходимо обеспечить вход в душевую кабину,образованную тремя стенами.Душевая дверь ,трехэлементная.Состоит из одной неподвижной и двух подвижных частей.Поэтому вход в душевой уголок может быть расположен как с одной,так и с другой стороны.Путем поворота изделия &quot;вверх ногами&quot; можно расположить вход в душевой уголок в соответствии с Вашими требованиями.Высота душевых дверей ASDP 3 188 см и поэтому их можно комбинировать только с жесткими стенками APSS(для создания душевой кабины)'),
(1596, 14, '00V70102ZG', 0, 1, NULL, '', 'ASDP3-90 (Grape) Душевая дверь', 'ASDP3-90 (Grape) Душевая дверь', 'Душевые двери используются ,в первую очередь,в тех случаях,когда необходимо обеспечить вход в душевую кабину,образованную тремя стенами.Душевая дверь ,трехэлементная.Состоит из одной неподвижной и двух подвижных частей.Поэтому вход в душевой уголок может быть расположен как с одной,так и с другой стороны.Путем поворота изделия &quot;вверх ногами&quot; можно расположить вход в душевой уголок в соответствии с Вашими требованиями.Высота душевых дверей ASDP 3 188 см и поэтому их можно комбинировать только с жесткими стенками APSS(для создания душевой кабины)'),
(1597, 14, '15V70102ZG', 0, 0, NULL, '', 'ASRV 3-90 (Grape) Душевой уголок', 'ASRV 3-90 (Grape) Душевой уголок', '&nbsp;</p><p>Душевые уголки с угловым входом предназначены,в первую очередь,для установки в угол помещения.Каждое изделие состоит из двух половин,которые раздельно упакованы,причем,каждая из половин имеет свою цену.Это позволяет комбинировать (в зависимости от желаний) квадратный или прямоугольный варианты.Одну половину ASRV3 всегда необходимо дополнять второй половиной ASRV3.Общая высота душевого уголка составляет 1880 мм и поэтому его можно комбинировать только с жесткими стенками типа APSS.'),
(1598, 14, 'SKU-3218', 0, 0, NULL, '', 'AVDP3-120 (Grape) Двери для ванн', 'AVDP3-120 (Grape) Двери для ванн', '&nbsp;</p><p>Если необходимо создать над ванной душевой уголок с максимально возможной герметичностью, то тогда лучше всего воспользоваться комбинацией AVDP3 + APSV.<br /><br /><a href="http://www.ravak.ru/?page=antiblock"></a> <a href="http://www.ravak.ru/?page=anticalc"></a> Примером решения совершенно герметичного душевого пространства над ванной, установленной в нише, является использование душевых дверей типа AVDP3.</p><p>Grape'),
(1599, 14, 'SKU-3219', 0, 0, NULL, '', 'AVDP3-120 (Rain) bahama Двери для ванн', 'AVDP3-120 (Rain) bahama Двери для ванн', 'Если необходимо создать над ванной душевой уголок с максимально возможной герметичностью, то тогда лучше всего воспользоваться комбинацией AVDP3 + APSV.<br /><br /><a href="http://www.ravak.ru/?page=antiblock"></a> <a href="http://www.ravak.ru/?page=anticalc"></a> Примером решения совершенно герметичного душевого пространства над ванной, установленной в нише, является использование душевых дверей типа AVDP3.</p><p>Rain'),
(1600, 14, 'SKU-3220', 0, 0, NULL, '', 'AVDP3-120 (Rain) Двери для ванн', 'AVDP3-120 (Rain) Двери для ванн', 'Принимая душ в ванне,мы часто должны решать,будем ли мы принимать душ с удобством стоя,и зальем всю ванную комнату,или же будем принимать душ в неудобном положении.Для этого компания Ravak предлагает установить на ванну шторку,препятствующую прямому разбрызгиванию воды непосредственно в помещение ванной комнаты.Высота шторок 1330 мм.Примером решения совершенно герметичного пространства над ванной,установленной в нише,является применение душевых дверей типа AVDP3.'),
(1601, 14, '40VG0102Z1', 0, 0, NULL, '', 'AVDP3-120 (Transp) Двери для ванн', 'AVDP3-120 (Transp) Двери для ванн', 'Если необходимо создать над ванной душевой уголок с максимально возможной герметичностью, то тогда лучше всего воспользоваться комбинацией AVDP3 + APSV.<br /><br /><a href="http://www.ravak.ru/?page=antiblock"></a> <a href="http://www.ravak.ru/?page=anticalc"></a> Примером решения совершенно герметичного душевого пространства над ванной, установленной в нише, является использование душевых дверей типа AVDP3.</p><p>Transp'),
