(1620, 14, '96030100ZG', 0, 0, NULL, '', 'DSS-75 (Grape) Стенка разделительная душевая', 'DSS-75 (Grape) Стенка разделительная душевая', 'Разделительные душевые стенки DSS являются абсолютно самостоятельными изделиями, которые используются, в первую очередь, для выделения пространств из интерьера. <br /><br />Разделительные душевые стенки DSS при помощи стандартного установочного профиля крепятся к стене, причем нижняя часть алюминиевой рамы опирается на землю. Для крепления разделительной стенки к полу используется силиконовая замазка RAVAK Profesional. Единственное отличие между душевой и ванной разделительными стенками состоит в их высоте. Разделительные стенки для ванн также крепятся с одной стороны к стене, причем нижняя часть рамы лежит на ванне или на опорной стенке. Разделительные стенки предоставляют прекрасную возможность для быстрой реконструкции ванной комнаты.'),
