(1682, 14, '1MP70100Z1', 0, 0, NULL, '', 'ESKPS-90 P(Transp) белый Душевой уголок', 'ESKPS-90 P(Transp) белый Душевой уголок', '<strong>ESKPS<br /><br /></strong></p><div class="obrazek" style="float: right; width: 65px"><a onclick="if (window.oWin) oWin(this.href,218,400,''ESKPS - схема'',''закрыть окно''); return false;" href="http://www.ravak.ua/img/psk/eskps_schema.gif"><strong></strong></a></div><p>Душевой уголок ESKPS состоит из одной поворотной двери (<strong>ESKR2</strong>) и одной неподвижной стенки (<strong>EPS</strong>).<br />В связи с разнообразием размеров каждый из этих элементов необходимо заказывать отдельно, но так, чтобы они образовали комплектный душевой уголок в варианте L или P. Неподвижная стенка (<strong>EPS</strong>) неподвижно соединена с душевым поддоном, а поворотная часть (<strong>ESKR2</strong>) открывается только наружу.'),
(1683, 14, '1MP70A00Z1', 0, 0, NULL, '', 'ESKPS-90 P(Transp) хром Душевой уголок', 'ESKPS-90 P(Transp) хром Душевой уголок', '<strong>ESKPS<br /><br /></strong></p><div class="obrazek" style="float: right; width: 65px"><a onclick="if (window.oWin) oWin(this.href,218,400,''ESKPS - схема'',''закрыть окно''); return false;" href="http://www.ravak.ua/img/psk/eskps_schema.gif"><strong></strong></a></div><p>Душевой уголок ESKPS состоит из одной поворотной двери (<strong>ESKR2</strong>) и одной неподвижной стенки (<strong>EPS</strong>).<br />В связи с разнообразием размеров каждый из этих элементов необходимо заказывать отдельно, но так, чтобы они образовали комплектный душевой уголок в варианте L или P. Неподвижная стенка (<strong>EPS</strong>) неподвижно соединена с душевым поддоном, а поворотная часть (<strong>ESKR2</strong>) открывается только наружу.'),
(1684, 14, '1ML70100Z1', 0, 0, NULL, '', 'ESKPS-90L (Transp) белый Душевой уголок', 'ESKPS-90L (Transp) белый Душевой уголок', ''),
(1685, 14, '1JEA0100Z1', 0, 0, NULL, '', 'ESKR2-100 (Transp) белый Душевой уголок', 'ESKR2-100 (Transp) белый Душевой уголок', '<strong>ESKR2<br /><br /></strong></p><div class="obrazek" style="float: right; width: 65px"><a onclick="if \n(window.oWin) oWin(this.href,204,400,''ESKR2 - схема'',''закрыть окно'','''');\n return false;" href="http://www.ravak.ua/img/psk/eskr2_schema.gif"><strong></strong></a></div><p>Душевой уголок с угловым входом ESKR2 состоит из двух поворотных элементов, обозначенных ESKR2 L и ESKR2 P.<br />При заказе душевого уголка всегда необходимо следить за тем, чтобы был заказан один левый /L/ и один правый /P/ элемент.<br />Оба элемента испытываются и комплектуются на заводе-изготовителе и отправляются заказчику вместе. Учитывая тот факт, что каждый из этих двух элементов может иметь иной размер, перед нами открывается возможность создания душевого уголка с прямоугольной или квадратной горизонтальной проекцией.<br />В душевом уголке этого типа предусмотрено также открывание дверей вовнутрь, что обеспечивает вентиляцию душевого уголка после использования и при этом оставшиеся на стекле капли могут стечь вниз на поддон.<br /><br />Рекомендованные поддоны: <a href="http://www.ravak.ua/uk/perseus">Perseus</a>, <a href="http://www.ravak.ua/uk/perseus-pro">Perseus Pro</a>.'),
