(1691, 14, '09PAAA00Z1', 0, 1, NULL, '', 'GSD2-100(Transp)A-R хром(990-1005)', 'GSD2-100(Transp)A-R хром(990-1005)', '&nbsp;</p><div class="obrazek"><a title="zvмtљit" onclick="if \n\n(window.oWin) oWin(this.href,268,400,''GSD2 - схема'',''закрыть окно'',''''); \n\nreturn false;" href="http://www.ravak.ua/img/psk/gsd2_schema.gif"></a></div><p>душевые двери GSD 2 состоят из одного подвижного и одного неподвижного элементов. Неподвижный элемент душевой двери прикреплен к стене при помощи двух специальных петель, которые способны исключить строительные неточности стен. Окончательная установка дверей &quot;настраивается&quot; благодаря увеличенным отверстиям в стеклах.<br />Для этого типа душевой двери различаем правый и левый варианты входа. Держатель неподвижной стенки не входит в состав поставки.'),
