(1705, 14, 'GU0801230002', 0, 0, NULL, '', 'GSD2-R(Transp) 855*1900  Душевая дверь', 'GSD2-R(Transp) 855*1900  Душевая дверь', '&nbsp;</p><div class="obrazek"><a title="zvмtљit" onclick="if \n(window.oWin) oWin(this.href,268,400,''GSD2 - схема'',''закрыть окно'',''''); \nreturn false;" href="http://www.ravak.ua/img/psk/gsd2_schema.gif"></a></div><p>душевые двери GSD 2 состоят из одного подвижного и одного неподвижного элементов. Неподвижный элемент душевой двери прикреплен к стене при помощи двух специальных петель, которые способны исключить строительные неточности стен. Окончательная установка дверей &quot;настраивается&quot; благодаря увеличенным отверстиям в стеклах.<br />Для этого типа душевой двери различаем правый и левый варианты входа. Держатель неподвижной стенки не входит в состав поставки.'),
(1706, 14, '09LA0A00Z1', 0, 0, NULL, '', 'GSD3-100L (Transp) хром Душевая дверь', 'GSD3-100L (Transp) хром Душевая дверь', '<strong>GSD3 - душевые двери GLASSLINE трехэлементные<br /><br /></strong></p><div class="obrazek"><a onclick="if (window.oWin) oWin(this.href,253,400,''GSD3 - схема'',''закрыть окно''); return false;" href="http://www.ravak.ua/img/psk/gsd3_schema.gif"><strong></strong></a></div><p>душевые двери трехэлементные образованы двумя неподвижными элементами и одним подвижным элементом, который позволяет войти в душевую кабину. Неподвижные элементы жестко прикреплены к стене и душевому поддону. В этом типе душевой двери также различают правый и левый варианты входа. душевые двери GSD3 с размером 120 стандартно оснащены одним коротким держателем. Короткий держатель помогает укрепить ту неподвижную стенку душевой двери, на которой находятся петли душевой двери. Душевые двери GSD 3 обеспечивают стандартный вход в нишу шириной от 100 до 120 см. Для ниш с более широким проёмом можно изготовить нестандартный вариант за счет увеличение ширины неподвижных элементов. Ширина подвижного элемента не изменится.'),
