(1737, 14, '0BL77A00ZM', 0, 0, NULL, '', 'GSDPS-90P Matrix Душевой уголок', 'GSDPS-90P Matrix Душевой уголок', '<strong>GSDPS <br />душевые двери GLASSLINE с неподвижной стенкой<br /><br /></strong></p><div class="obrazek" style="float: right; width: 80px"><a onclick="if (window.oWin) oWin(this.href,277,400,''GSDPS - схема'',''закрыть окно''); return false;" href="http://www.ravak.ua/img/psk/gsdps_schema.gif"><strong></strong></a></div><p>В этом типе изделий также можно получить прямоугольную форму, причем без специального увеличения цены. В таком случае в заказе необходимо подробно указать требуемый размер дверей и требуемый размер неподвижной стенки. В изделии GSDPS различают правый и левый варианты входа.'),
(1738, 14, '3KL77A00Z1', 0, 0, NULL, '', 'GSH3-90L (Transp) хром Душевой уголок', 'GSH3-90L (Transp) хром Душевой уголок', '<strong>GSH3 душевой уголок многоугольный трехэлементный<br /><br /></strong></p><div class="obrazek" style="float: right; width: 80px"><a onclick="if (window.oWin) oWin(this.href,275,400,''GSH3 - схема'',''закрыть окно''); return false;" href="http://www.ravak.ua/img/psk/gsh3_schema.gif"><strong></strong></a></div><p>Горизонтальная проекция этого душевого уголка позволяет его использовать в тех случаях, когда необходимо сэкономить место.<br />Душевые двери открываются наружу, причем следует различать правый и левый способ их открывания'),
(1739, 14, 'SKU-2684', 0, 0, NULL, '', 'GSH3-90L (Yellow Sky) Душевой уголок', 'GSH3-90L (Yellow Sky) Душевой уголок', '</p><p><strong>GSH3 душевой уголок многоугольный трехэлементный<br /><br /></strong></p><div class="obrazek" style="float: right; width: 80px"><a onclick="if (window.oWin) oWin(this.href,275,400,''GSH3 - схема'',''закрыть окно''); return false;" href="http://www.ravak.ua/img/psk/gsh3_schema.gif"><strong></strong></a></div><p>Горизонтальная проекция этого душевого уголка позволяет его использовать в тех случаях, когда необходимо сэкономить место.<br />Душевые двери открываются наружу, причем следует различать правый и левый способ их открывания'),
