(1741, 14, '3KP77A00Z1', 0, 0, NULL, '', 'GSH3-90P (Transp) хром Душевой уголок', 'GSH3-90P (Transp) хром Душевой уголок', '<strong>GSH3 душевой уголок многоугольный трехэлементный<br /><br /></strong></p><div class="obrazek" style="float: right; width: 80px"><a onclick="if (window.oWin) oWin(this.href,275,400,''GSH3 - схема'',''закрыть окно''); return false;" href="http://www.ravak.ua/img/psk/gsh3_schema.gif"><strong></strong></a></div><p>Горизонтальная проекция этого душевого уголка позволяет его использовать в тех случаях, когда необходимо сэкономить место.<br />Душевые двери открываются наружу, причем следует различать правый и левый способ их открывания'),
