(1743, 14, '37LAAA00Y1', 0, 0, NULL, '', 'GSKK3-100L (Transp) хром Душевой уголок', 'GSKK3-100L (Transp) хром Душевой уголок', ''),
(1744, 14, '37PAAA00Y1', 0, 0, NULL, '', 'GSKK3-100P (Transp) хром Душевой уголок', 'GSKK3-100P (Transp) хром Душевой уголок', ''),
(1745, 14, '37L44A00Y1', 0, 0, NULL, '', 'GSKK3-80L (Transp) хром Душевой уголок', 'GSKK3-80L (Transp) хром Душевой уголок', 'Красота в кажущейся простоте-это было основным кредо дизайнеров и конструкторов этой серии.Изделия серии Glassline состоят из неподвижных частей,крепящихся к стенам и из подвижных частей образующих вход в душевой уголок.Неподвижные части выполнены из безопасного закаленного стекла толщиной 8 мм.Подвижные стеклянные части имеют толщину 6 мм.</p><p>Данный уголок полукруглый трехэлементный.При выборе данного уголка необходимо принять решение о левом или правом варианте входа.Комплект душевого уголка состоит из стеклянных частей соответствующих размеров и соответствующего набора хромированных деталей G SET.Один держатель типа &quot;короткий&quot; включен в цену каждого изделия GSKK 3.Комплектуются поддонами Elipso,Tosca,Elipso PRO.</p><div class="obrazek" style="float: right"><a onclick="if \n(window.oWin) oWin(this.href,280,400,''GSKK3 - схема'',''закрыть окно'','''');\n return false;" href="http://www.ravak.ua/img/psk/gskk3_schema.gif"></a></div><p><br /><br />При выборе душевого уголка типа GSKK3 необходимо принять решение о левом или правом варианте входа.<br />Комплект душевого уголка GSKK3 состоит из стеклянных элементов имеющих соответствующие размеры, например GSKK3 - 80P; и соответствующего набора хромированных деталей, например G SET 80.<br />Стекла и хромированные детали упаковываются по одному изделию. Один держатель неподвижной стенки типа &bdquo;короткий&ldquo; включен в цену каждого изделия GSKK3.<br /><a href="http://www.ravak.ua/uk/anticalc"></a> '),
(1746, 14, '37O44A00Y1', 0, 0, NULL, '', 'GSKK3-80P (Transp) хром Душевой уголок', 'GSKK3-80P (Transp) хром Душевой уголок', '<strong><div class="obrazek" style="float: right"><a onclick="if \n(window.oWin) oWin(this.href,280,400,''GSKK3 - схема'',''закрыть окно'','''');\n return false;" href="http://www.ravak.ua/img/psk/gskk3_schema.gif"></a></div><p><br /><br />При выборе душевого уголка типа GSKK3 необходимо принять решение о левом или правом варианте входа.<br />Комплект душевого уголка GSKK3 состоит из стеклянных элементов имеющих соответствующие размеры, например GSKK3 - 80P; и соответствующего набора хромированных деталей, например G SET 80.<br />Стекла и хромированные детали упаковываются по одному изделию. Один держатель неподвижной стенки типа &bdquo;короткий&ldquo; включен в цену каждого изделия GSKK3.<br /><a href="http://www.ravak.ua/uk/anticalc"></a> </p></strong></p><p>&nbsp;'),
