(1750, 14, '17VAAA00ZM', 0, 0, NULL, '', 'GSKK4-100 (matrix) хром Душевой уголок', 'GSKK4-100 (matrix) хром Душевой уголок', '&nbsp;</p><div class="text"><strong>GSRV 4<br />душевой уголок с угловым входом четырехэлементный</strong><br /><br /><div class="obrazek"><a onclick="if \n(window.oWin) oWin(this.href,262,400,''GSRV4 - схема'',''закрыть окно'','''');\n return false;" href="http://www.ravak.ua/img/psk/gsrv4_schema.gif"></a></div>Этот тип душевого уголка монтируется в углу и имеет широкий и удобный вход.<br />Изделия GSRV 4 100 стандартно комплектуются двумя короткими держателями.</div><p><a href="http://www.ravak.ua/uk/anticalc"></a>'),
(1751, 14, '3A2AAA00Y1', 0, 0, NULL, '', 'GSKK4-100 (Transp.) хром Душевой уголок', 'GSKK4-100 (Transp.) хром Душевой уголок', '<strong>GSKK4 душевой уголок полукруглый четырехэлементный.<br /><br /></strong></p><div class="obrazek" style="float: right"><a onclick="if (window.oWin) oWin(this.href,287,400,''GSKK4 - схема'',''закрыть окно''); return false;" href="http://www.ravak.ua/img/psk/gskk4_schema.gif"><strong></strong></a></div><p>Для изделия GSKK4 не различаются левый и правый варианты исполнения.<br />Этот тип душевого уголка также разделен на стекла и хромированные детали.<br />Два &laquo;коротких&raquo; держателя поставляются только с изделием GSKK4 -100.<br />Для душевого уголка меньших размеров, при необходимости, держатели можно докупить отдельно.'),
(1752, 14, '3A244A00Y1', 0, 0, NULL, '', 'GSKK4-80 (Transp) хром Душевой уголок', 'GSKK4-80 (Transp) хром Душевой уголок', '<strong>GSKK4 душевой уголок полукруглый четырехэлементный.<br /><br /></strong></p><div class="obrazek" style="float: right"><a onclick="if (window.oWin) oWin(this.href,287,400,''GSKK4 - схема'',''закрыть окно''); return false;" href="http://www.ravak.ua/img/psk/gskk4_schema.gif"><strong></strong></a></div><p>Для изделия GSKK4 не различаются левый и правый варианты исполнения.<br />Этот тип душевого уголка также разделен на стекла и хромированные детали.<br />Два &laquo;коротких&raquo; держателя поставляются только с изделием GSKK4 -100.<br />Для душевого уголка меньших размеров, при необходимости, держатели можно докупить отдельно.'),
(1753, 14, '3A277A00Y1', 0, 1, NULL, '', 'GSKK4-90 (Transp) хром Душевой уголок', 'GSKK4-90 (Transp) хром Душевой уголок', '&nbsp;</p><div class="obrazek" style="float: right"><a onclick="if\n\n(window.oWin) oWin(this.href,287,400,''GSKK4 - схема'',''закрыть окно'','''');\n\nreturn false;" href="http://www.ravak.ua/img/psk/gskk4_schema.gif"></a></div><p>Для изделия GSKK4 не различаются левый и правый варианты исполнения.<br />Этот тип душевого уголка также разделен на стекла и хромированные детали.<br />Два &laquo;коротких&raquo; держателя поставляются только с изделием GSKK4 -100.<br />Для душевого уголка меньших размеров, при необходимости, держатели можно докупить отдельно.<br /><br /><strong>Поддоны:</strong> <a href="http://www.ravak.ua/uk/elipso">Elipso</a>, <a href="http://www.ravak.ua/uk/tosca">Tosca</a>, <a href="http://www.ravak.ua/uk/elipso-pro">Elipso Pro</a>.'),
