(1760, 14, '940A0100ZG', 0, 0, NULL, '', 'PSS-100 (Grape) Душевая жесткая стенка', 'PSS-100 (Grape) Душевая жесткая стенка', '<edit></edit>Неподвижные душевые стенки APSS/PSS и неподвижные стенки для ванн APSV/PSV можно комбинировать с большинством изделий ряда SUPERNOVA, что существенно увеличивает количество возможных вариантов.<br /><br />Объединяя душевые двери и неподвижную стенку APSS/PSS можно получить большое количество душевых кабин различной формы и размеров.<br /><br clear="all" /><br />Также можно использовать душевые двери в сочетании с двумя неподвижными стенками. В этом случае получим душевую кабину, горизонтальная проекция которой имеет форму буквы &quot;П&quot;.'),
(1761, 14, '940A0100ZP', 0, 0, NULL, '', 'PSS-100 (Strip) Душевая жесткая стенка', 'PSS-100 (Strip) Душевая жесткая стенка', '<edit></edit>Неподвижные душевые стенки APSS/PSS и неподвижные стенки для ванн APSV/PSV можно комбинировать с большинством изделий ряда SUPERNOVA, что существенно увеличивает количество возможных вариантов.<br /><br />Объединяя душевые двери и неподвижную стенку APSS/PSS можно получить большое количество душевых кабин различной формы и размеров.<br /><br clear="all" /><br />Также можно использовать душевые двери в сочетании с двумя неподвижными стенками. В этом случае получим душевую кабину, горизонтальная проекция которой имеет форму буквы &quot;П&quot;.'),
