(1779, 14, '0NVD0100Z1', 0, 0, NULL, '', 'RDP 2-110 белый Душевой уголок', 'RDP 2-110 белый Душевой уголок', 'Водоотталкивающий слой RAVAK ANTICALC&reg; обладает высокой стойкостью к действию чистящих средств, обычно применяемых для мойки оконных стекол и других стеклянных поверхностей. Однако стойкость этого слоя зависит от состава воды, с которой он находится в контакте. В целом можно сказать, что срок службы водоотталкивающего слоя RAVAK ANTICALC&reg; составляет от 6 месяцев до 5 лет.<br /><br />Капелек, оставшихся на стеклянных элементах душевой кабины, прошедших поверхностную обработку RAVAK ANTICALC&reg;, настолько мало, что операцию по уходу достаточно проводить всего лишь два раза в месяц.</p><p><strong>&nbsp;RDP2<br /><br /></strong>Душевые двери RDP2 поставляются универсально в левоми правом варианте. Покупатель может выбрать самый подходящий вариант в момент установки.'),
