(1828, 14, '9RV40U00ZG', 0, 1, NULL, '', 'RPS-100 satine(Grape)Душевой уголок', 'RPS-100 satine(Grape)Душевой уголок', '<strong>&nbsp;&nbsp;RPS<br /></strong>Душевые неподвижные стенки RPS можно комбинировать с большинством изделий серии RAPIER, что расширяет возможность применения изделий. <br /><br />Комбинацией душевых дверей и неподвижной стеннки RPS получим множество душевых уголков различных форм и размеров. <br /><br />Возможна и комбинация душевых дверей и двух неподвижных стенок. В таком случае получим уголок буквой &quot;U&quot;. <br /><br />У изделий серии RAPIER разработано удачное с точки зрения дизайна и к тому же <a onclick="if \n(window.oWin) oWin(this.href,300,208,'''',''закрыть окно'',''''); return \nfalse;" href="http://www.ravak.ua/img/psk/rps_spoj.jpg">жесткое соединение</a> двух изделий.'),
