(1836, 14, '03VA010011', 0, 0, NULL, '', 'SDOP-100 (Pearl) Душевая дверь', 'SDOP-100 (Pearl) Душевая дверь', '<strong>SDOP душевые двери вращающиеся поворотного типа<br /></strong></p><div class="obrazek" style="float: right; width: 80px"><a onclick="if (window.oWin) oWin(this.href,182,343,''SDOP - схема'',''закрыть окно''); return false;" href="http://www.ravak.ru/img/psk/sdop_schema.gif"><strong></strong></a></div><div class="mensi">SDOP состоит из одного неподвижного элемента и поворотных дверей. Это наиболее простой конструкционный вариант и поэтому наиболее выгодный с точки зрения цены. Левый или правый варианты входа также устанавливаются простым поворотом дверей &laquo;вверх ногами&raquo;.</div><p>&nbsp;'),
