(1884, 14, '311A0P0011', 0, 0, NULL, '', 'SKCP 4-100 (Pearl) Metal Душевой уголок', 'SKCP 4-100 (Pearl) Metal Душевой уголок', 'SKCP4 состоит из двух плоских неподвижных элементов и двух подвижных изогнутых частей, образующих раздвижные двери. Плоские элементы витражей позволяют использовать в этом душевом уголке поддоны типа <a href="http://www.ravak.ru/?page=ronda">RONDA</a>, <a href="http://www.ravak.ru/?page=elipso">ELIPSO</a>, <a href="http://www.ravak.ru/?page=tosca">TOSCA</a> и <a href="http://www.ravak.ru/?page=sabina">SABINA</a>, что обеспечивает получение большого количества вариантов при сохранении выгодной цены. Изогнутые элементы витража придают этому изделию прекрасный внешний вид.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p><p>Pearl</p><div class="obrazek_psk">&nbsp;</div><div class="obrazek" style="float: right; width: 67px"><a onclick="if \n(window.oWin) oWin(this.href,236,346,''Увеличить схему'',''закрыть \nокно'',''''); return false;" href="http://www.ravak.ua/img/psk/skcp4_sabina_schema.gif"></a></div><p>Бесспорно интересным вариантом, предназначенным, прежде всего для, для маленьких ванных комнат, являются &quot;укороченные&quot; душевые уголки, выпускаемые специально для глубоких поддонов с сиденьем - маленьких ванн. Маленькие ванны сочетают преимущества ванн и душевых уголков и тем самым представляют приемлемый промежуточный вариант. <br /><br />Главное преимущество глубоких поддонов - <strong>универсальность и низкое требование к пространству. </strong>.<br />Общая высота изделия (уголок + поддон) составляет 2 120 мм. <br />К поддону можно докупить сифон. <br /><br /><a href="http://www.ravak.ua/uk/antiblock"></a> <a href="http://www.ravak.ua/uk/anticalc"></a> Выпускаем укороченные варианты душевых уголков <strong>SKKP2</strong>, <strong>SKCP4</strong><br />и <strong>SKKP6</strong>.'),
