(1931, 14, '32070100ZP', 0, 0, NULL, '', 'SKKP 6-90 (Strip) Душевой уголок', 'SKKP 6-90 (Strip) Душевой уголок', 'SKKP6 состоит из двух неподвижных элементов и четырех подвижных элементов. Это изделие имеет наилучшее соотношение качества и цены. Именно поэтому SKKP6 стал наиболее продаваемым душевым уголком этой категории в Европе. Это изделие отличается, в первую очередь, испытанной годами надежностью. Все элементы витражей этого душевого уголка плоские (не изогнуты). Именно выбор таких элементов витражей позволил душевому уголку достичь наилучшего соотношения качества и цены. SKKP6 это душевой уголок, выпускаемый со всеми возможными узорами на полистирольном витраже или на закаленном стекле, входящем в ассортимент фирмы RAVAK. Душевой уголок SKKP6 можно установить на всех типах полукруглых душевых поддонов <a href="http://www.ravak.ru/?page=ronda">RONDA</a>, <a href="http://www.ravak.ru/?page=elipso">ELIPSO</a>, <a href="http://www.ravak.ru/?page=sabina">SABINA</a> и <a href="http://www.ravak.ru/?page=tosca">TOSCA</a></p><p>Strip'),
(1932, 14, '32074100Z1', 0, 1, NULL, '', 'SKKP 6-90 (Transp) Sabina Душевой уголок', 'SKKP 6-90 (Transp) Sabina Душевой уголок', 'SKKP6 состоит из двух неподвижных элементов и четырех подвижных элементов. Это изделие имеет наилучшее соотношение качества и цены. Именно поэтому SKKP6 стал наиболее продаваемым душевым уголком этой категории в Европе. Это изделие отличается, в первую очередь, испытанной годами надежностью. Все элементы витражей этого душевого уголка плоские (не изогнуты). Именно выбор таких элементов витражей позволил душевому уголку достичь наилучшего соотношения качества и цены. SKKP6 это душевой уголок, выпускаемый со всеми возможными узорами на полистирольном витраже или на закаленном стекле, входящем в ассортимент фирмы RAVAK. Душевой уголок SKKP6 можно установить на всех типах полукруглых душевых поддонов <a href="http://www.ravak.ru/?page=ronda">RONDA</a>, <a href="http://www.ravak.ru/?page=elipso">ELIPSO</a>, <a href="http://www.ravak.ru/?page=sabina">SABINA</a> и <a href="http://www.ravak.ru/?page=tosca">TOSCA</a></p><p>Transp'),
(1933, 14, '32070100Z1', 0, 1, NULL, '', 'SKKP 6-90 (Transp) Душевой уголок', 'SKKP 6-90 (Transp) Душевой уголок', 'SKKP6 состоит из двух неподвижных элементов и четырех подвижных элементов. Это изделие имеет наилучшее соотношение качества и цены. Именно поэтому SKKP6 стал наиболее продаваемым душевым уголком этой категории в Европе. Это изделие отличается, в первую очередь, испытанной годами надежностью. Все элементы витражей этого душевого уголка плоские (не изогнуты). Именно выбор таких элементов витражей позволил душевому уголку достичь наилучшего соотношения качества и цены. SKKP6 это душевой уголок, выпускаемый со всеми возможными узорами на полистирольном витраже или на закаленном стекле, входящем в ассортимент фирмы RAVAK. Душевой уголок SKKP6 можно установить на всех типах полукруглых душевых поддонов <a href="http://www.ravak.ru/?page=ronda">RONDA</a>, <a href="http://www.ravak.ru/?page=elipso">ELIPSO</a>, <a href="http://www.ravak.ru/?page=sabina">SABINA</a> и <a href="http://www.ravak.ru/?page=tosca">TOSCA</a></p><p>Transp'),
(1934, 14, '14VA0102ZG', 0, 0, NULL, '', 'SRV 2-100 (Grape) S Душевой уголок', 'SRV 2-100 (Grape) S Душевой уголок', '&nbsp;</p><p>Душевые уголки с угловым входом SRV2 - S&nbsp;предназначены, в первую очередь, для установки в углу помещения. Каждое из этих изделий состоит из двух половин, которые раздельно упакованы, причем каждая из этих половин имеет свою цену. Это позволяет комбинировать (в зависимости от пожелания) квадратный или прямо-угольный варианты.<br /><strong>Одну половину SRV2 - S&nbsp;всегда необходимо дополнить второй половиной SRV2 - S.</strong><br />Скомплектованные душевые уголки SRV2 - S&nbsp;можно дополнить <a href="http://www.ravak.ua/?page=supernova7">неподвижной стенкой /PSS/</a> и таким образовать душевую кабину в форме &quot;П&quot;&nbsp;&nbsp;'),
(1935, 14, '14VA010211', 0, 0, NULL, '', 'SRV 2-100 (Pearl) S Душевой уголок', 'SRV 2-100 (Pearl) S Душевой уголок', 'Душевые уголки с угловым входом SRV2 - S&nbsp;и ASRV3 предназначены, в первую очередь, для установки в углу помещения. Каждое из этих изделий состоит из двух половин, которые раздельно упакованы, причем каждая из этих половин имеет свою цену. Это позволяет комбинировать (в зависимости от пожелания) квадратный или прямоугольный варианты.<br /><strong>Одну половину SRV2 - S&nbsp;всегда необходимо дополнить второй половиной SRV2 - S. Точно также одну половину ASRV3 необходимо дополнить второй половиной ASRV3.</strong> Взаимная комбинация двухпазовой системы /SRV2 - S/ и трехпазовой системы /ASRV3/ невозможна.<br />Скомплектованные душевые уголки SRV2 - S&nbsp;и ASRV3 можно дополнить <a href="http://www.ravak.ru/?page=supernova7">неподвижной стенкой /PSS,APSS/</a> и таким образовать душевую кабину в форме &quot;П&quot;.</p><p>Pear'),
(1936, 14, '14VA0102ZP', 0, 0, NULL, '', 'SRV 2-100 (Strip) S Душевой уголок', 'SRV 2-100 (Strip) S Душевой уголок', 'Душевые уголки с угловым входом SRV2 - S&nbsp;и ASRV3 предназначены, в первую очередь, для установки в углу помещения. Каждое из этих изделий состоит из двух половин, которые раздельно упакованы, причем каждая из этих половин имеет свою цену. Это позволяет комбинировать (в зависимости от пожелания) квадратный или прямоугольный варианты.<br /><strong>Одну половину SRV2 - S&nbsp;всегда необходимо дополнить второй половиной SRV2 - S. Точно также одну половину ASRV3 необходимо дополнить второй половиной ASRV3.</strong> Взаимная комбинация двухпазовой системы /SRV2 - S/ и трехпазовой системы /ASRV3/ невозможна.<br />Скомплектованные душевые уголки SRV2 - S&nbsp;и ASRV3 можно дополнить <a href="http://www.ravak.ru/?page=supernova7">неподвижной стенкой /PSS,APSS/</a> и таким образовать душевую кабину в форме &quot;П&quot;.</p><p>Strip'),
