(2056, 15, 'A000000003', 0, 1, NULL, '', 'Монтажный набор Galaxy 100', 'Монтажный набор Galaxy 100', 'Монтажный набор применяется для уплотнения душевого поддона при его  установке в уже полностью выложенный кафелем душевой уголок. Без  вмешательства в поверхности стен достигается идеальное, с точки зрения  оформления, и функциональное, с точки зрения уплотнения, соединение  душевого поддона со стеной ванной комнаты.<br clear="all" /><br /><br />  <strong><em>Неаккуратное соединение поддонa со стеной легко исправить. В зазор  между поддоном и стеной можно вставить планку, с помощью которой Ваша  работа станет действительно профессиональной.</em></strong>'),
(2057, 15, 'A000000001', 0, 0, NULL, '', 'Монтажный набор Kaskada 900 мм', 'Монтажный набор Kaskada 900 мм', 'Монтажный набор применяется для уплотнения душевого поддона при его  установке в уже полностью выложенный кафелем душевой уголок. Без  вмешательства в поверхности стен достигается идеальное, с точки зрения  оформления, и функциональное, с точки зрения уплотнения, соединение  душевого поддона со стеной ванной комнаты.<br clear="all" /><br /><br />  <strong><em>Неаккуратное соединение поддонa со стеной легко исправить. В зазор  между поддоном и стеной можно вставить планку, с помощью которой Ваша  работа станет действительно профессиональной.</em></strong>'),
(2058, 15, 'XB2J000000N', 0, 1, NULL, '', 'Ножки GALAXY PRO 90', 'Ножки GALAXY PRO 90', 'Универсальная опорная конструкция предназначена для всех поддонов типа&nbsp;<a href="http://www.ravak.ua/uk/tipy-dushevykh-poddonov">LA</a> (за  исключением поддонов  TOSCA, TAURUS и SABINA) и служит для простого  выравнивания плоскости поддона. Установленный таким способом поддон  можно обложить кирпичом и облицевать кафелем. Универсальная опорная  конструкция состоит из двух металлических балок (длиной 600, 650 или 700  мм в зависимости от размера поддона) и четырех регулируемых ножек.'),
