(2105, 15, 'A003701320', 0, 1, NULL, '', 'Поддон ANETA 75Х90 EX-R', 'Поддон ANETA 75Х90 EX-R', 'Поддоны типа EX состоят из полиуретанового носителя и акриловой формы. От поддонов типа PU отличаются тем, что поддон типа EX обрезан так, чтобы можно было облицевать его кафелем. В таком случае облицовка клеится непосредственно к поддону.<br /><strong>Не каждый профессионал в состоянии безошибочно сделать каркас и после этого облицовку круглой формы. Но при этом даже новичок сможет облицевать полиуретановый носитель керамической плиткой.</strong></p><p><strong></strong>'),
(2106, 15, 'A003701220', 0, 0, NULL, '', 'Поддон ANETA 75Х90 LA-R', 'Поддон ANETA 75Х90 LA-R', 'Поддоны типа LA состоят из акриловой формы и укреплены слоистым стекловолокном.<br /><strong>Поддоны типа LA предназначены для установки в пол или в бетонный каркас.</strong>'),
(2107, 15, 'A003701120', 0, 1, NULL, '', 'Поддон ANETA 75Х90 PU-R', 'Поддон ANETA 75Х90 PU-R', 'Поддоны типа PU состоят из акриловой формы и заполнены пенополиуретаном с добавлением стекловолокна. PU поддоны самонесущие, штампованные вместе с панелью.<br /><strong>Установка PU вопрос нескольких минут. Если учесть расходы, связанные с установочными работами, тогда поддоны PU являются, конечно, самым экономным и, одновременно самым быстрым вариантом установки. Акриловый поддон, в отличие от металлического, не надо заземлять.</strong></p><p><strong></strong>'),
(2108, 15, 'A004401320', 0, 0, NULL, '', 'Поддон ANGELA 80 EX-R', 'Поддон ANGELA 80 EX-R', 'Поддоны типа EX состоят из полиуретанового носителя и акриловой формы. От поддонов типа PU отличаются тем, что поддон типа EX обрезан так, чтобы можно было облицевать его кафелем. В таком случае облицовка клеится непосредственно к поддону.<br /><strong>Не каждый профессионал в состоянии безошибочно сделать каркас и после этого облицовку круглой формы. Но при этом даже новичок сможет облицевать полиуретановый носитель керамической плиткой.</strong>'),
(2109, 15, 'A014401220', 0, 0, NULL, '', 'Поддон ANGELA 80 LA', 'Поддон ANGELA 80 LA', 'Поддоны типа LA состоят из акриловой формы и укреплены слоистым стекловолокном.<br /><strong>Поддоны типа LA предназначены для установки в пол или в бетонный каркас.</strong>'),
(2110, 15, 'A004401120', 0, 1, NULL, '', 'Поддон ANGELA 80 PU-R', 'Поддон ANGELA 80 PU-R', 'Поддоны типа PU состоят из акриловой формы и заполнены пенополиуретаном с добавлением стекловолокна. PU поддоны самонесущие, штампованные вместе с панелью.<br /><strong>Установка PU вопрос нескольких минут. Если учесть расходы, связанные с установочными работами, тогда поддоны PU являются, конечно, самым экономным и, одновременно самым быстрым вариантом установки. Акриловый поддон, в отличие от металлического, не надо заземлять.</strong>'),
(2111, 15, 'A007701320', 0, 1, NULL, '', 'Поддон ANGELA 90 EX-R', 'Поддон ANGELA 90 EX-R', 'Поддоны типа EX состоят из полиуретанового носителя и акриловой формы. От поддонов типа PU отличаются тем, что поддон типа EX обрезан так, чтобы можно было облицевать его кафелем. В таком случае облицовка клеится непосредственно к поддону.<br /><strong>Не каждый профессионал в состоянии безошибочно сделать каркас и после этого облицовку круглой формы. Но при этом даже новичок сможет облицевать полиуретановый носитель керамической плиткой.</strong>'),
