(2116, 15, 'A22AA01310', 0, 1, NULL, '', 'Поддон ELIPSO 100 EX', 'Поддон ELIPSO 100 EX', 'Поддоны типа EX состоят из полиуретанового носителя и акриловой формы. От поддонов типа PU отличаются тем, что поддон типа EX обрезан так, чтобы можно было облицевать его кафелем. В таком случае облицовка клеится непосредственно к поддону.<br /><strong>Не каждый профессионал в состоянии безошибочно сделать каркас и после этого облицовку круглой формы. Но при этом даже новичок сможет облицевать полиуретановый носитель керамической плиткой.</strong>'),
(2117, 15, 'A22AA01210', 0, 0, NULL, '', 'Поддон ELIPSO 100 LA', 'Поддон ELIPSO 100 LA', 'Поддоны типа LA состоят из акриловой формы и укреплены слоистым стекловолокном.<br /><strong>Поддоны типа LA предназначены для установки в пол или в бетонный каркас.</strong>'),
(2118, 15, 'A22AA01410', 0, 1, NULL, '', 'Поддон ELIPSO 100 PAN', 'Поддон ELIPSO 100 PAN', 'Поддоны типа PAN состоят из двух отделяемых друг от друга частей, а именно - из поддона и панели, которая крепится к полиуретановому носителю. Передняя панель входит в состав изделия и учтена в цене поддона.<br /><strong>Система съемной передней панели PAN реализована у самых элитных поддонов (ELIPSO и MODUS) серии GALAXY.</strong>'),
(2119, 15, 'SKU-3011', 0, 1, NULL, '', 'Поддон ELIPSO 100 PRO', 'Поддон ELIPSO 100 PRO', ''),
(2120, 15, 'A224401310', 0, 1, NULL, '', 'Поддон ELIPSO 80 EX', 'Поддон ELIPSO 80 EX', 'Поддоны типа EX состоят из полиуретанового носителя и акриловой формы. От поддонов типа PU отличаются тем, что поддон типа EX обрезан так, чтобы можно было облицевать его кафелем. В таком случае облицовка клеится непосредственно к поддону.<br /><strong>Не каждый профессионал в состоянии безошибочно сделать каркас и после этого облицовку круглой формы. Но при этом даже новичок сможет облицевать полиуретановый носитель керамической плиткой.</strong>'),
(2121, 15, 'A224401210', 0, 0, NULL, '', 'Поддон ELIPSO 80 LA', 'Поддон ELIPSO 80 LA', 'Поддоны типа LA состоят из акриловой формы и укреплены слоистым стекловолокном.<br /><strong>Поддоны типа LA предназначены для установки в пол или в бетонный каркас.</strong>'),
(2122, 15, 'A224401410', 0, 1, NULL, '', 'Поддон ELIPSO 80 PAN', 'Поддон ELIPSO 80 PAN', 'Поддоны типа PAN состоят из двух отделяемых друг от друга частей, а именно - из поддона и панели, которая крепится к полиуретановому носителю. Передняя панель входит в состав изделия и учтена в цене поддона.<br /><strong>Система съемной передней панели PAN реализована у самых элитных поддонов (ELIPSO и MODUS) серии GALAXY.</strong>'),
(2123, 15, 'XA234401010', 0, 1, NULL, '', 'Поддон ELIPSO 80 PRO', 'Поддон ELIPSO 80 PRO', '<br /><table cellspacing="10" border="0"><tbody><tr><td valign="top" width="260">&nbsp;</td><td valign="top">Новая серия душевых поддонов GALAXY PRO использует преимущества натуральных материалов, таких как, мрамор и гранит. <br /><br />Благодаря совершенному материалу, из которого поддоны изготовлены, возможность их применения практически не ограничена. Они подходят в качестве престижного изделия в ванной комнате Вашего дома, но благодаря своей устойчивости они идеально подойдут для мест общего пользования, таких как, спортивные комплексы, больницы, курорты и другие.</td></tr><tr><td colspan="2">Специальная поверхностная обработка, препятствующая скольжению, повышает безопасность во время принятия душа. <br /><br />Эти поддоны не требуют никакой строительной подготовки и их можно комбинировать с любим душевым уголком. Благодаря своей толщине (30 мм) их можно установить в пол в качестве решения для лиц с ограниченной подвижностью.</td></tr><tr><td colspan="2"><hr noshade="noshade" /></td></tr><tr><td valign="top" width="260"><a onclick="if (window.oWin) oWin(this.href,450,132,'''',''закрыть окно''); return false;" href="http://www.ravak.ua/img/psv/pro_schema.gif"></a> <br clear="all" /><br />Поддоны серии Galaxy PRO можно устанавливать в бетонный каркас (например, при установке поддона в пол) и применение набора ножек (BASE) в таком случае не обязательно. Для установки поддонов серии Galaxy PRO на пол ванной комнаты необходимо использовать набор ножек (Galaxy PRO BASE) и по желанию переднюю панель с крючками (SET).</td><td>Отверстие для сифона 90 мм обеспечивает достаточный сток воды из поддона. Рекомендуем сифоны типа STANDARD или PROFESSIONAL из нашего ассортимента.<br /><br /></td></tr></tbody></table>');
