(2124, 15, 'A227701310', 0, 1, NULL, '', 'Поддон ELIPSO 90 EX', 'Поддон ELIPSO 90 EX', 'Поддоны типа EX состоят из полиуретанового носителя и акриловой формы. От поддонов типа PU отличаются тем, что поддон типа EX обрезан так, чтобы можно было облицевать его кафелем. В таком случае облицовка клеится непосредственно к поддону.<br /><strong>Не каждый профессионал в состоянии безошибочно сделать каркас и после этого облицовку круглой формы. Но при этом даже новичок сможет облицевать полиуретановый носитель керамической плиткой.</strong>'),
