(2143, 15, 'A02AA01510', 0, 0, NULL, '', 'Поддон PERSEUS 100 PP', 'Поддон PERSEUS 100 PP', 'У поддонов типа PP также использована система съемной передней панели. Различаем панели типа &quot;N&quot; /для поддонов уставленных в нише/ и панель типа &quot;L&quot;, который применяется при установке поддона в угол. По причине разновидностей вариантов, панели для поддонов продаются отдельно и поэтому не входят в цену поддона.<br /><strong>Между поддонами типов EX и PP разница в конструкции носителя. Панель, предназначенную для поддона PP, невозможно прикре-пить к поддону EX.</strong>'),
