(2155, 15, 'A607001120', 0, 1, NULL, '', 'Поддон RADIUS 90 PU-R', 'Поддон RADIUS 90 PU-R', 'Поддоны типа PU состоят из акриловой формы и заполнены пенополиуретаном с добавлением стекловолокна. PU поддоны самонесущие, штампованные вместе с панелью.<br /><strong>Установка PU вопрос нескольких минут. Если учесть расходы, связанные с установочными работами, тогда поддоны PU являются, конечно, самым экономным и, одновременно самым быстрым вариантом установки. Акриловый поддон, в отличие от металлического, не надо заземлять.</strong>'),
