(2172, 15, 'A207001320', 0, 1, NULL, '', 'Поддон полукр.RONDA-90 EX-R', 'Поддон полукр.RONDA-90 EX-R', 'Поддоны типа EX состоят из полиуретанового носителя и акриловой формы. От поддонов типа PU отличаются тем, что поддон типа EX обрезан так, чтобы можно было облицевать его кафелем. В таком случае облицовка клеится непосредственно к поддону.<br /><strong>Не каждый профессионал в состоянии безошибочно сделать каркас и после этого облицовку круглой формы. Но при этом даже новичок сможет облицевать полиуретановый носитель керамической плиткой.</strong>'),
(2173, 15, 'A217001220', 0, 1, NULL, '', 'Поддон полукр.RONDA-90 LA-R', 'Поддон полукр.RONDA-90 LA-R', 'Поддоны типа LA состоят из акриловой формы и укреплены слоистым стекловолокном.<br /><strong>Поддоны типа LA предназначены для установки в пол или в бетонный каркас.</strong>'),
(2174, 15, 'A207001120', 0, 1, NULL, '', 'Поддон полукр.RONDA-90 PU-R', 'Поддон полукр.RONDA-90 PU-R', 'Поддоны типа PU состоят из акриловой формы и заполнены пенополиуретаном с добавлением стекловолокна. PU поддоны самонесущие, штампованные вместе с панелью.<br /><strong>Установка PU вопрос нескольких минут. Если учесть расходы, связанные с установочными работами, тогда поддоны PU являются, конечно, самым экономным и, одновременно самым быстрым вариантом установки. Акриловый поддон, в отличие от металлического, не надо заземлять.</strong>'),
