(2420, 16, '0456034078', 0, 0, NULL, '', 'HANSACLEAR Lux Комплект настенных стоек', 'HANSACLEAR Lux Комплект настенных стоек', 'HANSACLEAR LUX способствует восприятию воды поистине всеми органами чувств. Прозрачный материал, использованный для этой программы, произвел революцию в дизайне душа: благодаря ему водопроводные пути в верхней душевой головке становятся видимыми. Но это еще не все: кроме того, душ подсвечивается изнутри. Цвет подсветки можно выбрать простым нажатием кнопки, чтобы любимые краски могли помочь Вам расслабиться или, наоборот, обрести тонус. Белый, желтый, оранжевый, красный, фиолетовый, синий, голубой или зеленый - Вам выбирать!</p><p>Техника &laquo;в Ваших руках&raquo;: подсветка питается от размещенного в ручке маленького аккумулятора, который не требует частой подзарядки. При необходимости его можно быстро зарядить в зарядном устройстве. Работа ручного душа обеспечивается независимо от состояния зарядки аккумулятора.</p><p>'),
