(3454, 19, 'B8F0000013', 0, 0, NULL, '', 'Сидение OVO-P-Blue', 'Сидение OVO-P-Blue', 'Сиденья серии OVO складываются и в сложенном виде практически не  занимают в душевом уголке никакого места.<br /> 			<br /> 			Массивная конструкция всех сидений сении OVO изготовлена из  нержавеющей стали.</p><p>&nbsp;'),
