(3456, 19, 'B8F0000001', 0, 1, NULL, '', 'Сидение OVO-P-Opal', 'Сидение OVO-P-Opal', 'Сиденья серии OVO складываются и в сложенном виде практически не  занимают в душевом уголке никакого места.<br /> 			<br /> 			Массивная конструкция всех сидений сении OVO изготовлена из  нержавеющей стали.</p><p>'),
