(3458, 19, 'B8F0000011', 0, 0, NULL, '', 'Сидение OVO-R-Clear', 'Сидение OVO-R-Clear', 'Единственным вариантом, как в относительно маленьком душевом уголке  присесть, является угловое сиденье серии OVO&nbsp;R.<br /> 			<br /> 			ВНИМАНИЕ! Угловые сиденья серии OVO R не складываются!'),
