(3463, 20, '0AEF4IWA', 0, 1, NULL, '', 'Divatech D F24', 'Divatech D F24', '<strong>Газовый котел Ferroli Divatech D F24</strong><br /><strong>Технические характеристики:</strong><br />Настенный котел с инжекционной горелкой<br />Для отопления и горячего водоснабжения, с применением двух раздельных теплообменников<br />Мощность 24 кВт, с естественной тягой или принудительным отводом продуктов сгорания<br />Работа на природном или сжиженном газе<br />Мак. производительность 25.8 квт<br />Мин. производительность 8.3 квт<br />Мак. тепл.мощность 24 квт<br />Мак. тепл.мощ в режиме ГСВ 24 квт<br />Обьем бака 8 л<br />Вес 32 кг<br />Размеры ШхВхГ (мм) 700х400х330</p><p><strong>Описание:</strong><br />Первичный медный теплообменник (СО)<br />Вторичный пластинчатый теплообменник из нержавеющей стали 10 пластин<br />(ГВС) управляются 3-х ходовым клапаном (230 В)<br />Многофункциональная панель управления, с большим дисплеем и кнопками управления<br />3-х скоростной циркуляционный насос с функцией антиблокировки: насос включается на несколько секунд раз в сутки если котел находится в режиме ожидания<br />Атмосферная горелка из нержавеющей стали (AISI 304)<br />Возможно подключение датчика наружной температуры и пульта дистанционного управления (опция)<br />Высокая эффективность, 3 звезды по директиве EN 92/42 (принудительный отвод продуктов сгорания, модель F)<br />Модуляционный режим работы в обеих режимах &ndash; в отоплении и горячем водоснабжении<br />Режим ECO/COMFORT для быстрого производства горячей воды<br />Функция &laquo;Антизамерзания&raquo;, активна при наличии газа и электропитания<br />Класс защиты IPX5D'),
