(3471, 20, '0D9C4I4A', 0, 0, NULL, '', 'DOMITECH C 24', 'DOMITECH C 24', '<strong><em>МОДЕЛЬ С: ЕСТЕСТВЕННАЯ ТЯГА, ОТКРЫТАЯ КАМЕРА<br />&nbsp;&nbsp;&nbsp;&nbsp;<br />МОДЕЛЬ F: ПРИНУДИТЕЛЬНАЯ ТЯГА, ЗАКРЫТАЯ КАМЕРА СГОРАНИЯ</em></strong><br />&nbsp;&nbsp;&nbsp;&nbsp;<br /><strong>ОТЛИЧИТЕЛЬНЫЕ ОСОБЕННОСТИ:<br /></strong>&nbsp;&nbsp;&nbsp;&nbsp;<br />- современный улучшенный дизайн;<br />&nbsp;&nbsp;&nbsp;&nbsp;<br />- новая панель управления, на дисплее отображается температура и режим работы котла;</p><p>- компактный медный теплообменник (патент <font color="#ff6600">Ferroli</font>), состоит из 3-х последовательно соединенных трубок, внутри которых проходят змеевидные трубки контура ГВС, внешняя поверхность, покрытая антикоррозионным составом на основе алюминия;<br />&nbsp;&nbsp;&nbsp;&nbsp;<br />- камера сгорания выполнена из стали с антикоррозионным алюминиевым покрытием и изолирована внутри экологическим материалом;<br />&nbsp;&nbsp;&nbsp;&nbsp;<br />- инжекционная горелка, с головками из нержавеющей стали AISI 304, электрический розжиг&nbsp;без запальника, система безопасности на базе ионизационного электрода;<br />&nbsp;&nbsp;&nbsp;&nbsp;<br />- процесс модуляции мощности систем отопления и ГВС управляется электронной платой, оборудованной микропроцессором;<br />&nbsp;&nbsp;&nbsp;&nbsp;<br />- система антиблокировки насоса контура отопления, каждые 24 часа бездействия котла на несколько секунд включает насос;<br />&nbsp;&nbsp;&nbsp;&nbsp;<br />- система защиты от замерзания;<br />&nbsp;&nbsp;&nbsp;&nbsp;<br />- возможность подключения дистанционного управления и комнатного термостата.<br />&nbsp;&nbsp;&nbsp;&nbsp;<br /><strong>ПРЕИМУЩЕСТВА <font color="#ff6600">DOMItech</font>:</strong>&nbsp;<br />&nbsp;&nbsp;&nbsp;&nbsp;<br />- функция ECO и Comfort в режиме ГВС для возможности быстрого получения горячей воды;</p> <p>- высокий КПД (до 93,1%), благодаря применению новых технологий и максимально рациональной конструкции;<br />&nbsp;&nbsp;&nbsp;&nbsp;<br />- компактные размеры и небольшой вес котла, один из самых маленьких котлов, присутствующих сегодня на рынке;<br />&nbsp;&nbsp;&nbsp;&nbsp;<br />- удобное расположение внутренних компонентов котла, которое обеспечивает легкий доступ к&nbsp;ним с фронтальной части котла, что упрощает и ускоряет процесс сервисного и технического&nbsp;обслуживания;<br />&nbsp;&nbsp;&nbsp;&nbsp;<br />- электронная система управления на базе микропроцессора, которая значительно повышает&nbsp;скорость работы и производительность системы, а также обеспечивает самодиагностику неисправностей;<br />&nbsp;&nbsp;&nbsp;&nbsp;<br />- максимальная надежность и безопасность;<br />&nbsp;&nbsp;&nbsp;&nbsp;<br />- ЖК - дисплей&nbsp;и удобный интерфейс для удобства обслуживания котла;<br />&nbsp;&nbsp;&nbsp;&nbsp;<br />- возможность эксплуатации как на сжиженном, так и на природном газе (при условии использования специального комплекта).'),
