(3482, 20, '0N3X3IAA', 0, 0, NULL, '', 'ECONCEPT KOMBI 15A', 'ECONCEPT KOMBI 15A', '<strong>НАПОЛЬНЫЙ ГАЗОВЫЙ КОНДЕНСАЦИОННЫЙ КОТЕЛ, ОБЕСПЕЧИВАЮЩИЙ ПОДАЧУ ГОРЯЧЕЙ ВОДЫ В СИСТЕМУ ОТОПЛЕНИЯ И ГВС. КОТЕЛ ОБОРУДОВАН НАКОПИТЕЛЬНЫМ БОЙЛЕРОМ, МИКРОФАКЕЛЬНОЙ ГОРЕЛКОЙ, МОЖЕТ РАБОТАТЬ В МНОГОКОНТУРНОЙ СИСТЕМЕ С РАЗЛИЧНЫМИ ТЕМПЕРАТУРАМИ КОНТУРОВ</strong></p><p><strong>ОТЛИЧИТЕЛЬНЫЕ ОСОБЕННОСТИ:</strong></p><p>- Алюминиевый теплообменник выполняющий также функцию конденсатора.</p><p>- Керамическая горелка с реверсивным пламенем, низким уровнем эмиссии возможностью использования различных видов газообразного топлива и непрерывной модуляцией пламени.</p><p>- Электронная система управления на базе двух микропроцессоров с возможностью подключения каскадного регулятора, датчика наружной температуры и дистанционного управления.</p><p>- Цифровое управление рабочими параметрами котла.</p><p>- На дисплее отображается температура и режим работы котла.</p><p>- Производство горячей санитарной воды при помощи накопительного водонагревателя объемом 140 литров.</p><p>- Трехскоростной циркуляционный насос на контуре отопления и насос с постоянной скоростью на контуре ГВС.</p><p>- Система контроля горения на базе микропроцессора, осуществляет три попытки розжига при погасании пламени, после чего происходит блокировка котла.</p><p>- Съемная боковая панель, для обеспечения легкого доступа к подключения в задней части котла.</p><p>- Возможность эксплуатации совместно с дистанционным управлением.</p><p><strong>ПРЕИМУЩЕСТВА <font color="#ff6600">ECONCEPT KOMBI</font>:</strong></p><p>- высокий КПД - до 109%.</p><p>- экономия энергии, за счет применения конденсационных технологий и эксплуатации котла в режиме компенсации наружной температуры.</p><p>- Высокие экологические показатели работы (очень низкий уровень эмиссии NOx и СО), благодаря современной модели керамической горелки с синим пламенем и технологии полного предварительного смешения.</p><p>- Легкость установки, позволяет устанавливать в систему с любым типом отопительных элементов (панельные радиаторы, радиаторы&hellip;).</p><p>- Возможность эксплуатации в многоконтурной системе: максимум до 3 контуров + ГВС, 1 высокотемпературный конур и 2 низкотемпературных.</p><p>- Комплект работы в многоконтурной системе устанавливается непосредственно внутри котла.</p><p>- Максимальный КПД даже в случае работы в системах с высоко- и низкотемпературным контурами.</p><p>- Блок контроля устанавливается непосредственно на панели управления котла.</p><p>- Возможность организации рециркуляции в накопительном водонагревателе.</p><p>- Системы защиты: защита от замерзания, защита насоса от блокировки, защита от отсутствия циркуляции в системе.</p><p>- Работа в режиме компенсации наружной температуры (при подключенном наружном датчик).</p><p>- Возможность работы на сжиженном газе пропане LPG.</p><p><table cellspacing="0" cellpadding="0" width="707" border="1"><tbody><tr><td width="330" colspan="3"><p><strong>МОДЕЛЬ </strong></p></td><td width="178"><p align="center"><strong>25 C</strong></p></td><td width="199"><p align="center"><strong>35 C</strong></p></td></tr><tr><td width="196" rowspan="2"><p align="left"><strong>Номинальная тепловая мощность</strong></p></td><td width="81"><p align="center">Мин.</p></td><td width="52"><p align="center">кВт</p></td><td width="178"><p align="center">7,5</p></td><td width="199"><p align="center">10,4</p></td></tr><tr><td width="81"><p align="center">Макс.</p></td><td width="52"><p align="center">кВт</p></td><td width="178"><p align="center">25,2</p></td><td width="199"><p align="center">34,8</p></td></tr><tr><td width="196" rowspan="2"><p align="left"><strong>Тепловая мощность при графике&nbsp; 80 <sup>0</sup>С/60 <sup>0</sup>C</strong></p></td><td width="81"><p align="center">Мин.</p></td><td width="52"><p align="center">кВт</p></td><td valign="bottom" width="178"><p align="center">7,3</p></td><td valign="bottom" width="199"><p align="center">10,2</p></td></tr><tr><td width="81"><p align