 align="center">%</p></td><td valign="top" width="178"><p align="center">109,3</p></td><td valign="top" width="199"><p align="center">109,1</p></td></tr><tr><td width="196" rowspan="2"><p><strong>Объем воды в контуре</strong></p></td><td width="81"><p align="center">отопления</p></td><td width="52"><p align="center">л</p></td><td valign="top" width="178"><p align="center">12</p></td><td valign="top" width="199"><p align="center">12</p></td></tr><tr><td width="81"><p align="center">ГВС</p></td><td width="52"><p align="center">л</p></td><td valign="top" width="178"><p align="center">4</p></td><td valign="top" width="199"><p align="center">4</p></td></tr><tr><td width="277" colspan="2"><p><strong>Объем бойлера</strong></p></td><td width="52"><p align="center">л</p></td><td width="178"><p align="center">140</p></td><td width="199"><p align="center">140</p></td></tr><tr><td width="196" rowspan="2"><p><strong>Производительность контура ГВС</strong></p></td><td width="81"><p align="center">&#8710;t 30 <sup>0</sup>C</p></td><td width="52"><p align="center">л/мин</p></td><td valign="top" width="178"><p align="center">12,0</p></td><td valign="top" width="199"><p align="center">16,5</p></td></tr><tr><td width="81"><p align="center">&#8710;t 25 <sup>0</sup>C</p></td><td width="52"><p align="center">л/мин</p></td><td valign="top" width="178"><p align="center">14,4</p></td><td valign="top" width="199"><p align="center">19,8</p></td></tr><tr><td width="196"><p><strong>Производительность контура ГВС</strong></p></td><td width="81"><p align="center">&#8710;t 30 <sup>0</sup>C</p></td><td width="52"><p align="center">л/10 мин</p></td><td valign="top" width="178"><p align="center">290</p></td><td valign="top" width="199"><p align="center">310</p></td></tr><tr><td valign="bottom" width="277" colspan="2"><p><strong>Максимальное давление в контуре отопления</strong></p></td><td valign="bottom" width="52"><p align="center">бар</p></td><td valign="bottom" width="178"><p align="center">3</p></td><td valign="bottom" width="199"><p align="center">3</p></td></tr><tr><td valign="top" width="277" colspan="2"><p><strong>Минимальное давление в контуре отопления</strong></p></td><td valign="top" width="52"><p align="center">бар</p></td><td valign="top" width="178"><p align="center">0,8</p></td><td valign="top" width="199"><p align="center">0,8</p></td></tr><tr><td width="277" colspan="2"><p><strong>Вес в упаковке (брутто)</strong></p></td><td width="52"><p align="center">кг</p></td><td width="178"><p align="center">166</p></td><td width="199"><p align="center">169</p></td></tr><tr><td width="277" colspan="2"><p><strong>Электрическая мощность (не включая аксессуары)</strong></p></td><td width="52"><p>&nbsp;</p><p align="center">Вт</p></td><td width="178"><p align="center">150</p></td><td width="199"><p align="center">150</p></td></tr><tr><td valign="top" width="330" colspan="3"><p><strong>Класс электрозащиты</strong></p></td><td valign="top" width="178"><p align="center">IPX4D</p></td><td valign="top" width="199"><p align="center">IPX4D</p></td></tr></tbody></table>'),
