(3485, 20, '11010337RU', 0, 1, NULL, '', 'EVE 05 CTFS 24', 'EVE 05 CTFS 24', 'Котел EVE 05 оснащен необходимыми устройствами безопасности и контроля, предусмотренными европейскими нормами и директивами. <br />Монотермический теплообменник, пластичны теплообменник ГВС и 3-х ходовой кран приоритета ГВС с электроприводом. Котел EVE 05 разработан для максимального удобства пользования. Надежно работает при снижении давления природного газа до 5 мбар. При давлении 10 мбар работает на мощности 20кВт.<br /><br />Панель управления изготовлена в соответствии с основными правилами эргономики и имеет следующие компоненты:<br /><br />- Простой мультифункциональный ЖКИ дисплей, видимый даже в темноте, отображает температуру отопления ГВС, блокировку при отсутствии пламени, режим работы ожидания и диагностики 11 видов неисправностей;<br />- Электронный розжиг со строгим циклом зажигания пламени обеспечивает надежность в любимых климатических условиях;<br />- Постоянная модуляция (изменение расхода) газа. Пропорциональная &ndash; комплексная, управляемая микропроцессором, как в режиме отопления, так в режиме, так и в режиме приготовления ГВС при помощи двух контрольных датчиков (для ГВС и отопления), которые определяют заданные установки с очень высокой точностью;<br />- Пост-циркуляция (защита от перегрева): в течение 15 секунд в любых условиях контролирует температурный баланс между подачей и обработкой, даже после интенсивного забора горячей воды, в то время как при работе на отопление в течении 5 минут позволяет использовать все остаточное тепло;<br />- Защита от замерзания срабатывает при температуре 5&deg;С как в режиме отопления, так и ГВС, увеличивая температуру в котле до 15&deg;С. Исчезает риск размораживания котла EVE 05 при низких температурах в помещении, в котором он установлен.<br />- Защита от блокировки насоса после долгих периодов бездействия, каждые 24 часа подается 5 секундный импульс, который заставляет вращаться насос с целью предотвратить его заржавление и закаливание;<br />- Функция очистки дымохода облегчает действия по регулировке сгорания. При нажатии кнопки разблокировки дольше 3-х секунд, можно получить работу котла на минимальной или максимальной мощности в течение 15 минут для того, чтобы произвести все необходимые настройки газового котла.<br />- Щелевая газовая горелка вместе с электродом, выполняющим функцию розжига, а после ее завершения и функцию контроля горения.<br />- 3-х скоростной циркуляционный насос со встроенным воздухоотводчиком и фильтром.<br />- Реле протока воды ГВС, обеспечивающее управление выработкой (приоритет) ГВС. Удобная для обслуживания и ремонта конструктивная схема котла, позволяющая легко снимать (выдвигание вперед) любой из основных элементов котла:<br /><br />Unical EVE 24 имеет красивый дизайн&nbsp; и небольшую глубину в 310мм, он был разработан для простоты использования, быстрого монтажа и удобного доступа к компонентам при его гарантийном и сервисном обслуживании.&nbsp;&nbsp; <br /><strong><br />Компоненты котла EVE 24:</strong><br />- Два теплообменника; Теплообменник на ГВС из нержавеющей стали AISI 316L;<br />- Электрический трехходовой клапан;<br />- Автоматический бай-пасс;<br />- Простой мультифункциональный ЖКИ дисплей;<br />- Электронный розжиг;<br />- Постоянная модуляция газа;<br />- Защита от перегрева;<br />- Защита от замерзания;<br />- Защита от блокировки насоса;<br />- Функция очистки дымохода.'),
(3486, 20, '11010352', 0, 1, NULL, '', 'EVE 05 CTFS 24 F', 'EVE 05 CTFS 24 F', 'Котел EVE 05 оснащен необходимыми устройствами безопасности и контроля, предусмотренными европейскими нормами и директивами. <br />Битермический (совмещенный для отопления и ГВС) теплообменник. Котел EVE 05 разработан для максимального удобства пользования. Надежно работает при снижении давления природного газа до 5 мбар. При давлении 10 мбар работает на мощности 20кВт.<br /><br />Панель управления изготовлена в соответствии с основными правилами эргономики и имеет следующие компоненты:<br /><br />- Простой мультифункциональный ЖКИ дисплей, видимый даже в темноте, отображает температуру отопления ГВС, блокировку при отсутствии пламени, режим работы ожидания и диагностики 11 видов неисправностей;<br />- Электронный розжиг со строгим циклом зажигания пламени обеспечивает надежность в любимых климатических условиях;<br />- Постоянная модуляция (изменение расхода) газа. Пропорциональная &ndash; комплексная, управляемая микропроцессором, как в режиме отопления, так в режиме, так и в режиме приготовления ГВС при помощи двух контрольных датчиков (для ГВС и отопления), которые определяют заданные установки с очень высокой точностью;<br />- Пост-циркуляция (защита от перегрева): в течение 15 секунд в любых условиях контролирует температурный баланс между подачей и обработкой, даже после интенсивного забора горячей воды, в то время как при работе на отопление в течении 5 минут позволяет использовать все остаточное тепло;<br />- Защита от замерзания срабатывает при температуре 5&deg;С как в режиме отопления, так и ГВС, увеличивая температуру в котле до 15&deg;С. Исчезает риск размораживания котла EVE 05 при низких температурах в помещении, в котором он установлен.<br />- Защита от блокировки насоса после долгих периодов бездействия, каждые 24 часа подается 5 секундный импульс, который заставляет вращаться насос с целью предотвратить его заржавление и закаливание;<br />- Функция очистки дымохода облегчает действия по регулировке сгорания. При нажатии кнопки разблокировки дольше 3-х секунд, можно получить работу котла на минимальной или максимальной мощности в течение 15 минут для того, чтобы произвести все необходимые настройки газового котла.<br />- Щелевая газовая горелка вместе с электродом, выполняющим функцию розжига, а после ее завершения и функцию контроля горения.<br />- 3-х скоростной циркуляционный насос со встроенным воздухоотводчиком и фильтром.<br />- Реле протока воды ГВС, обеспечивающее управление выработкой (приоритет) ГВС. Удобная для обслуживания и ремонта конструктивная схема котла, позволяющая легко снимать (выдвигание вперед) любой из основных элементов котла:<br /><br />Unical EVE 24 имеет красивый дизайн&nbsp; и небольшую глубину в 310мм, он был разработан для простоты использования, быстрого монтажа и удобного доступа к компонентам при его гарантийном и сервисном обслуживании.&nbsp;&nbsp; <br /><br /><strong>Компоненты котла EVE 24:</strong><br />- Один битермический теплообменник;<br />- Электрический трехходовой клапан;<br />- Автоматический бай-пасс;<br />- Простой мультифункциональный ЖКИ дисплей;<br />- Электронный розжиг;<br />- Постоянная модуляция газа;<br />- Защита от перегрева;<br />- Защита от замерзания;<br />- Защита от блокировки насоса;<br />- Функция очистки дымохода.'),
