(3504, 20, '1QGDX10B', 0, 0, NULL, '', 'GN2 N10', 'GN2 N10', '<font color="#000000"><strong><span style="font-size: 9.5pt; font-family: Arial">НАПОЛЬНЫЙ ЧУГУННЫЙ КОТЕЛ ДЛЯ ИСПОЛЬЗОВАНИЯ СОВМЕСТНО С НАДДУВНОЙ ВЕНТИЛЯТОРНОЙ ГОРЕЛКОЙ НА ГАЗООБРАЗНОМ ИЛИ ЖИДКОМ ТОПЛИВЕ</span></strong><span style="font-size: 9.5pt; font-family: Arial"><o:p></o:p></span></font></p><p><font color="#000000"><strong><span style="font-size: 9.5pt; font-family: Arial">ОТЛИЧИТЕЛЬНЫЕ ОСОБЕННОСТИ:</span></strong><span style="font-size: 9.5pt; font-family: Arial"><o:p></o:p></span></font></p><p><span style="font-size: 9.5pt; font-family: Arial"><font color="#000000">- Высокопроизводительный чугунный напольный котел для эксплуатации с вентиляторной горелкой на жидком и/или газообразном топливе с реверсивной водоохлаждаемой топкой, предназначенный для использования в системах отопления.<o:p></o:p></font></span></p><p><span style="font-size: 9.5pt; font-family: Arial"><font color="#000000">- Чугунный корпус котла состоит из чугунных секций соединенных при помощи металлических конических ниппелей и стяжной шпильки, корпус котла изолирован слоем минеральной ваты укрепленной специальным не рвущимся материалом.<o:p></o:p></font></span></p><p><span style="font-size: 9.5pt; font-family: Arial"><font color="#000000">- Стальной корпус окрашен методом напыления эпоксидного порошка.<o:p></o:p></font></span></p><p><span style="font-size: 9.5pt; font-family: Arial"><font color="#000000">- Отгружаться в деревянной обрешетке.<o:p></o:p></font></span></p><p><strong><span style="font-size: 9.5pt; font-family: Arial"><font color="#000000">ПРЕИМУЩЕСТВА&nbsp;</font><span style="color: #ff6600">GN2 N</span><font color="#000000">:</font></span></strong><span style="font-size: 9.5pt; font-family: Arial"><o:p></o:p></span></p><p><span style="font-size: 9.5pt; font-family: Arial"><font color="#000000">- Высокоэффективный чугунный теплообменник.<o:p></o:p></font></span></p><p><span style="font-size: 9.5pt; font-family: Arial