(3518, 20, '1LGDX07C', 0, 0, NULL, '', 'GN4 N7', 'GN4 N7', '<font color="#000000"><strong><span style="font-size: 9.5pt; font-family: Arial">НАПОЛЬНЫЙ ЧУГУННЫЙ КОТЕЛ ДЛЯ ИСПОЛЬЗОВАНИЯ СОВМЕСТНО С НАДДУВНОЙ ВЕНТИЛЯТОРНОЙ ГОРЕЛКОЙ НА ГАЗООБРАЗНОМ ИЛИ ЖИДКОМ ТОПЛИВЕ</span></strong><span style="font-size: 9.5pt; font-family: Arial"><o:p></o:p></span></font></p><p><font color="#000000"><strong><span style="font-size: 9.5pt; font-family: Arial">ОТЛИЧИТЕЛЬНЫЕ ОСОБЕННОСТИ:</span></strong><span style="font-size: 9.5pt; font-family: Arial"><o:p></o:p></span></font></p><p><span style="font-size: 9.5pt; font-family: Arial"><font color="#000000">- Высокопроизводительный трехходовой чугунный напольный котел для эксплуатации с вентиляторной горелкой на жидком и/или газообразном топливе с водоохлаждаемой топкой, предназначенный для использования в как обычной так и низкотемпературной (температура воды в обратном трубопроводе составляет 35<sup>о</sup>С) системах отопления.<o:p></o:p></font></span></p><p><span style="font-size: 9.5pt; font-family: Arial"><font color="#000000">- Чугунный корпус котла состоит из чугунных секций соединяемых при помощи металлических конических ниппелей и стяжных шпилек, корпус котла изолируется слоем минеральной ваты укрепленной специальным не рвущимся материалом. <o:p></o:p></font></span></p><p><span style="font-size: 9.5pt; font-family: Arial"><font color="#000000">- Стальной корпус окрашен методом напыления эпоксидного порошка.<o:p></o:p></font></span></p><p><span style="font-size: 9.5pt; font-family: Arial"><font color="#000000">- Котел может поставляться как в собранном, так и в разобранном виде.<o:p></o:p></font></span></p><p><strong><span style="font-size: 9.5pt; font-family: Arial"><font color="#000000">ПРЕИМУЩЕСТВА </font><span style="color: #ff6600">GN4 N</span><font color="#000000">:</font></span></strong><span style="font-size: 9.5pt; font-family: Arial"><o:p></o:p></span></p><p><span style="font-size: 9.5pt; font-family: Arial"><font color="#000000">- Высокий КПД, благодаря использованию новых технологий и максимальной рациональности конструкции.<o:p></o:p></font></span></p><p><span style="font-size: 9.5pt; font-family: Arial"><font color="#000000">- Специальная конструкция чугунного корпуса котла, благодаря которой обеспечивается подключение котла, как к обычной системе отопления, так и к низкотемпературной системе.<o:p></o:p></font></span></p><p><span style="font-size: 9.5pt; font-family: Arial"><font color="#000000">- Предусмотрен для использования совместно с двухступенчатой горелкой. <o:p></o:p></font></span></p><p><span style="font-size: 9.5pt; font-family: Arial"><font color="#000000">- Возможность подключения внешнего электронного блока управления.<o:p></o:p></font></span></p><p><table class="MsoNormalTable" style="border-right: medium none; border-top: medium none; border-left: medium none; width: 72.04%; border-bottom: medium none; border-collapse: collapse; mso-border-alt: solid #EDBE30 .75pt; mso-padding-alt: 0cm 0cm 0cm 0cm" cellspacing="0" cellpadding="0" width="72%" border="1"><tbody><tr style="mso-yfti-irow: 0; mso-yfti-firstrow: yes"><td style="border-right: #edbe30 1pt solid; padding-right: 1.45pt; border-top: #edbe30 1pt solid; padding-left: 1.45pt; padding-bottom: 1.45pt; border-left: #edbe30 1pt solid; width: 56.4pt; padding-top: 1.45pt; border-bottom: #edbe30 1pt solid; background-color: transparent; mso-border-alt: solid #EDBE30 .75pt" width="79" rowspan="2"><p class="MsoNormal" style="margin: 0cm 0cm 0pt; text-align: center" align="center"><font color="#000000"><strong><span style="font-size: 8.5pt; font-family: Arial">МОДЕЛЬ</span></strong><span style="font-size: 8.5pt; font-family: Arial"><o:p></o:p></span></font></p></td><td style="border-right: #edbe30 1pt solid; padding-right: 1.45pt; border-top: #edbe30 1pt solid; padding-left: 1.45pt; border-left-color: #c0c0c0; padding-bottom: 1.45pt; width: 56.65pt; padding-top: 1.45pt; border-bottom: #edbe30 1pt solid; background-color