(3572, 20, '1AATA30A', 0, 1, NULL, '', 'TANTAQUA NF 30/100 EL', 'TANTAQUA NF 30/100 EL', '<strong>НАПОЛЬНЫЙ ГАЗОВЫЙ КОТЕЛ, ВСТРОЕННЫЙ БОЙЛЕР, ЗАКРЫТАЯ КАМЕРА СГОРАНИЯ, ЭЛЕКТРОННЫЙ РОЗЖИГ С СИСТЕМОЙ КОНТРОЛЯ НАЛИЧИЯ ПЛАМЕНИ НА БАЗЕ ИОНИЗАЦИОННОГО ЭЛЕКТРОДА</strong></p><p><strong>ОТЛИЧИТЕЛЬНЫЕ ОСОБЕННОСТИ:</strong></p><p>- Высокопроизводительный газовый напольный котел с закрытой камерой сгорания оборудованной вентилятором.</p><p>- Высокоэффективный медный орбренный теплообменник покрытый антикоррозионным составом на основе алюминия</p><p>- Инжекционная горелка, с головками из нержавеющей стали AISI 304, электрический розжиг без запальника с устройством безопасности, которое контролирует ток ионизации, вырабатываемы пламенем.</p><p>- Высокий КПД котла за счет непрерывной модуляции пламени</p><p><strong>ПРЕИМУЩЕСТВА </strong><font color="#ff6600"><strong>TANTAQUA</strong><strong> </strong><strong>NF</strong></font><strong>:</strong></p><p>- Высокая надежность, благодаря качеству материалов и компонентов, используемых в агрегате</p><p>- Корпус окрашен в белый цвет напылением эпоксидного порошка.</p><p>- Стальной встроенный бойлер емкостью 100 литров со стеклокерамическим покрытием внутренней поверхности, изолированный пенополиуретоном.</p><p>- Два циркуляционных насоса для контура отопления и контура ГВС.</p><p>- Закрытый расширительный бак на конуре отопления емкостью 10 литров и закрытый расширительный бак на контуре ГВС 3 литра.</p><p>- Электронная система управления на базе микропроцессора, которая значительно повышает скорость работы и производительность системы.</p><p>- Информационной дисплей на базе светодиодов.</p><p><table cellspacing="0" cellpadding="0" width="402" border="1"><tbody><tr><td valign="top" width="323" colspan="3"><p><strong>МОДЕЛЬ</strong></p></td><td valign="top" width="79"><p align="center"><strong>NF 30/100</strong></p></td></tr><tr><td width="223" rowspan="2"><p><strong>Номинальная тепловая мощность</strong></p></td><td valign="top" width="49"><p align="center">Макс.</p></td><td valign="top" width="51"><p align="center">кВт</p></td><td width="79"><p align="center">30</p></td></tr><tr><td valign="top" width="49"><p align="center">Мин.</p></td><td valign="top" width="51"><p align="center">кВт</p></td><td width="79"><p align="center">12,7</p></td></tr><tr><td width="223" rowspan="2"><p><strong>Тепловая нагрузка</strong></p></td><td valign="top" width="49"><p align="center">Макс.</p></td><td valign="top" width="51"><p align="center">кВт</p></td><td width="79"><p align="center">33,1</p></td></tr><tr><td valign="top" width="49"><p align="center">Мин.</p></td><td valign="top" width="51"><p align="center">кВт</p></td><td width="79"><p align="center">14,5</p></td></tr><tr><td width="223" rowspan="2"><p><strong>Производительность контура ГВС</strong></p></td><td valign="top" width="49" rowspan="2"><p align="center">&Delta;t 30<sup>0 </sup>С</p></td><td width="51"><p align="center">л/10 мин.</p></td><td width="79"><p align="center">220</p></td></tr><tr><td width="51"><p align="center">л/час</p></td><td width="79"><p align="center">930</p></td></tr><tr><td valign="top" width="272" colspan="2"><p><strong>Объем воды в котле</strong></p></td><td valign="top" width="51"><p align="center">л</p></td><td width="79"><p align="center">10,7</p></td></tr><tr><td valign="top" width="272" colspan="2"><p><strong>Объем воды в бойлере</strong></p></td><td valign="top" width="51"><p align="center">л</p></td><td width="79"><p align="center">100</p></td></tr><tr><td valign="top" width="272" colspan="2"><p><strong>Объем расширительного бака</strong></p></td><td valign="top" width="51"><p align="center">л</p></td><td width="79"><p align="center">10</p></td></tr><tr><td valign="top" width="272" colspan="2"><p><strong>Объем расширительного бака системы ГВС</strong></p></td><td valign="top" width="51"><p align="center">л</p></td><td width="79"><p align="center">3</p></td></tr><tr><td valign="top" width="272" colspan="2"><p><strong>Максимальное рабочее давление в котле</strong></p></td><td valign="top" width="51"><p align="center">бар</p></td><td width="79"><p align="center">3</p></td></tr><tr><td valign="top" width="272" colspan="2"><p><strong>Максимальное рабочее давление в бойлере</strong></p></td><td valign="top" width="51"><p align="center">бар</p></td><td width="79"><p align="center">9</p></td></tr><tr><td valign="top" width="323" colspan="3"><p><strong>Класс электробезопасности</strong></p></td><td width="79"><p align="center">IP 40</p></td></tr></tbody></table>'),
