(4005, 21, 'XTREME', 0, 1, NULL, '', 'Радиатор биметаллический Radiatori 2000 XTREME 500', 'Радиатор биметаллический Radiatori 2000 XTREME 500', '<strong>Радиатор биметаллический XTREME</strong>. Разработанный и изготовленный на фирме Radiatori 2000 S.p.A новый радиатор модели &ldquo;EXTREME&rdquo; гарантирует максимальную теплоотдачу при минимальных затратах. Биметаллический радиатор, выполненный в процессе литья под давлением, гарантированное давление 40 атмсфер, предлагается с межосевым расстоянием 500 мм. Радиатор современного округленного профиля легко вписывается в любой интерьер, c успехом удовлетворяя самые изысканные вкусы.</p><p><span style="text-decoration: underline">Основные характеристики:</span></p><p>Рабочее давление &mdash; до&nbsp;25 атм.<br />Испытательное давление &mdash; до&nbsp;37 атм.<br />Максимальная температура теплоносителя &mdash; 110&deg; С<br />Значение pH воды &mdash; от 6,5 до 8,5 (оптимальное 7-8)<br />Цвет &mdash; белый, RAL 9016</p><p>Литые биметаллические (сталь-алюминий) секционные радиаторы с развитым продольным оребрением колонок. Покрытие &ndash; порошковая эпоксидно-полиэфирная эмаль с горячей сушкой. Для сборки секций используется автоматическая линия, выполняющая крепеж стальными ниппелями. Все изделия проходят испытания на герметичность, что исключает дефекты в радиаторах, которые поступают в продажу.</p><p>Радиаторы предназначены для систем отопления с температурой теплоносителя до 110<sup><font size="2">0</font></sup>С и максимальным рабочим давлением&nbsp;37 бар.</p><h2>Производственный процесс</h2><p>Секция радиатора XTREME состоит из стальной трубы, залитой под высоким давлением алюминиевым сплавом, обладающим высокими прочностными и отличными литейными свойствами. Полученное в результате монолитное изделие обеспечивает эффективную теплоотдачу при максимальном запасе прочности. Сборка секций производится стальными ниппелями на автоматической линии. Герметичность в местах соединения секций обеспечивается&nbsp; уплотнительными прокладками.</p><p>После сборки все радиаторы проходят испытание на герметичность под высоким давлением 37 бар для выявления дефектов, которые могли возникнуть на различных этапах производства, что обеспечивает стопроцентное качество продукции.</p><h2>Технические характеристики:</h2><p>Глубина - 95 мм</p><p>Высота - 577 мм</p><p>Межосевое расстояние - 500 мм</p><p>Ширина - 80 мм</p><p>Присоединительный диаметр - 1&quot;</p><p>Вес - 1,73 кг</p><p>Вместимость секций - 0,22 л/секц.</p><p>Теплоотдача dT = 50K - 112 Вт/секц.</p><p>Теплоотдача dT = 70K - 180 Вт/секц.</p><p>Для расчета dT используется следующая формула: теплоотдача (dT = 50K) x (dT новый:50)</p><p>*Величина теплоотдачи dT 50, соответствует указанной в новой Европейской форме EN 442.'),
