(4025, 22, 'sku_13131411222', 0, 0, NULL, '', 'Водонагреватель ABS SGHP Slim 50 V', 'Водонагреватель ABS SGHP Slim 50 V', 'Вертикальный водонагреватель ARISTON ABS SGHP 50V SLIM с накопительной системой, имеющий объём 50 л и мощность 1,5 кВт. Система ABS обеспечит безопасность нагрева воды с защитным устройством от утечки и возможного поражения током (УЗО). Благодаря специальным разработкам надежного покрытия AG+, защищен от коррозийного повреждения стенок. Водонагреватель прочен, долговечен, а также прост и удобен в эксплуатации. В модели ARISTON ABS SGHP 50V SLIM имеется достаточно узкое дно (диаметр 353 мм). К следующим особенностям бойлера относится: увеличенный анод, быстрый нагрев, пенополиуретановое теплоизолирование, что позволяет экономить электроэнергию, а также Nanomix-рассекатель, что позволяет получить больше воды для душа за короткий небольшой промежуток времени.Размеры (ШхВхГ) 35x84x37 мм'),
