(4046, 23, 'sku_119643110044', 0, 1, NULL, '', 'Насос IMP GHN 25/40-130', 'Насос IMP GHN 25/40-130', 'Циркуляционные насосы группы GHN предназначены для принудительной циркуляции в системах отопления и охлаждения. Циркуляционные насосы имеют производительность от 0,1 до 1,7 л/с (от 0,36 до 6 м3/ч) при давлении до 60 кПа (6 м водяного столба). Разрешенная температура перекачиваемой среды - до 110&deg;C. Насос является одноступенчатым, центробежным, со спиральным корпусом и закрытым якорем. Ротор отделён от статора защитной гильзой, изготовленной из специальной нержавеющей стали, и погружён в воду. Особая втулка защищает его от абразивных и коррозионных воздействий. Нержавеющий вал электромотора насоса вращается в смазываемых водой графитных подшипниках. Уплотнение статическое.</p><p>'),
